    hu: "SZERVERHIBA. Úgy tűnik, hogy a tanulmánya nem érhető el (404) a Pavlovia szerveren. Ez többféleképpen is megtörténhet. A probléma megoldásának módja:\n1. Lehet, hogy ez egy pillanatnyi probléma volt, mára megszűnt. Lehet, hogy Pavlovia lassan tette elérhetővé a tanulmányt, vagy átmeneti kiesés volt a magas szerverforgalom miatt. Próbálja meg frissíteni a tanulmányi oldalt a böngésző címsorában található frissítés gombra ↻ kattintva. Többször is próbálkozhatsz. Ha elérhetővé válik, a tanulmány a szokásos módon fog futni.\n2. Ennek hiányában az EasyEyes fordító oldalán kattintson a „Go to Pavlovia” gombra (az oldal jobb alsó sarkában) a Pavlovia irányítópult megnyitásához a tanulmányhoz.\n3. A Pavlovia műszerfalon győződjön meg arról, hogy a dolgozószoba „RUNNING” módban van. Ha INAKTÍV, akkor nyomja meg a FUTÁS gombot. Két másodpercen belül a tanulmánya FUTÁS módba kapcsol, és a szokásos módon futhat. Menjen vissza az EasyEyes fordítóoldalára, és kattintson a FUTATÁS gombra, vagy használja a tanulmány URL-címét.\n4. Ha az Ön nem elérhető tanulmánya már FUTTATÁS módban van, ez általában azt jelzi, hogy a tanulmányának nincs kreditje/engedélye az online tesztelés kifizetéséhez. Három módja van a folytatásnak.\n5. INGYENES PILÓTA A PAVLOVIA IRÁNYÍTÓPULTRÓL. Ha tetszik, kattintson a PILOTÁZÁS gombra a Pavlovia műszerfalon, hogy a dolgozószobáját PILOTÁZÁS módba helyezze. Futtassa le tanulmányát a PILOT gomb megnyomásával (a Pavlovia műszerfalon). Ez ingyenes, de a tanulmányi URL továbbra sem érhető el.\n6. FUTÁS ONLINE HITELVEL. Az online futtatáshoz ugyanazon az irányítópulton vásárolhat krediteket a Pavloviától, és néhányat hozzárendelhet ehhez a tanulmányhoz. Ez lehetővé teszi a tanulmány online futtatását.\n7. ONLINE FUTÁS ENGEDÉLYVEL. Az EasyEyes rendelkezik Pavlovia webhelylicencével. Írjon a denis.pelli@nyu.edu címre, és kérje, hogy az e-mail címe szerepeljen az EasyEyes Pavlovia webhely licencében. (Vagy, ha az intézménye rendelkezik Pavlovia webhely licenccel, használhatja helyette.) Adja meg e-mail címét a Pavlovia irányítópultján, hogy igazolja, hogy rendelkezik engedéllyel, amelyre a Pavlovia emlékezni fog a következő üléseken. Ez lehetővé teszi, hogy minden tanulmánya online futhasson.",
    is: 'VILLA í þjóni. Rannsóknin þín virðist ekki vera tiltæk (404) á Pavlovia þjóninum. Það eru nokkrar leiðir sem þetta getur gerst. Svona á að laga vandamálið:\n1. Það gæti hafa verið augnabliksmál, nú horfið. Kannski var Pavlovia seinn við að gera rannsóknina aðgengilega, eða það var tímabundið stöðvun vegna mikillar umferðar netþjóna. Prófaðu að endurnýja rannsóknarsíðuna með því að smella á endurnýjunarhnappinn ↻ á veffangastiku vafrans þíns. Þú getur prófað oftar en einu sinni. Ef það verður tiltækt mun námið ganga venjulega.\n2. Ef það tekst ekki, á EasyEyes þýðandasíðunni, smelltu á "Fara til Pavlovia" hnappinn (neðst hægra megin á síðunni) til að opna Pavlovia mælaborðið fyrir námið þitt.\n3. Í Pavlovia mælaborðinu skaltu ganga úr skugga um að námið þitt sé í „RUNNING“ ham. Ef það er Óvirkt skaltu ýta á RUNNING hnappinn. Eftir tvær sekúndur mun rannsóknin þín skipta yfir í RUNNING ham og getur nú keyrt venjulega. Farðu aftur á EasyEyes þýðandasíðuna og smelltu á RUN, eða notaðu rannsóknarslóðina.\n4. Ef námið þitt sem ekki er tiltækt er nú þegar í RUNNING-ham, gefur það venjulega til kynna að námið þitt vanti inneign/leyfi til að greiða fyrir próf á netinu. Það eru þrjár leiðir til að halda áfram.\n5. Flugmaður FRÍTT FRÁ PAVLOVIA MJÖLBLÆÐI. Ef þú vilt geturðu smellt á PILOTING hnappinn í Pavlovia mælaborðinu til að setja námið þitt í PILOTING ham. Keyrðu rannsóknina þína með því að ýta á PILOT hnappinn (í Pavlovia mælaborðinu). Það er ókeypis, en námsslóðin þín er enn ótiltæk.\n6. Hlaupa á netinu MEÐ LÁN. Til að keyra á netinu geturðu keypt einingar frá Pavlovia á sama mælaborði og úthlutað nokkrum til þessa náms. Það mun leyfa þessari rannsókn að keyra á netinu.\n7. HLUTAÐ Á NETINU MEÐ LEYFI. EasyEyes er með síðuleyfi fyrir Pavlovia. Skrifaðu á denis.pelli@nyu.edu og biddu um að fá tölvupóstinn þinn með í EasyEyes Pavlovia síðuleyfinu. (Eða ef stofnunin þín er með Pavlovia-síðuleyfi geturðu notað það í staðinn.) Gefðu upp netfangið þitt á Pavlovia mælaborðinu til að sýna að þú sért með leyfi, sem Pavlovia mun muna í komandi fundum. Þetta gerir allt nám þitt kleift að keyra á netinu.',
    id: "Loading...",
    it: "ERRORE DEL SERVER. Il tuo studio sembra non essere disponibile (404) sul server Pavlovia. Questo può accadere in diversi modi. Ecco come risolvere il problema:\n1. Potrebbe essersi verificato un problema momentaneo, ora risolto. Forse Pavlovia ha rallentato la disponibilità dello studio o si è verificata un'interruzione temporanea dovuta all'elevato traffico sul server. Prova ad aggiornare la pagina dello studio cliccando sul pulsante Aggiorna ↻ nella barra degli indirizzi del browser. Puoi riprovare più volte. Se la disponibilità è disponibile, lo studio verrà eseguito normalmente.\n2. In caso contrario, nella pagina del compilatore EasyEyes, clicca sul pulsante \"Vai a Pavlovia\" (in basso a destra della pagina) per aprire la dashboard di Pavlovia per il tuo studio.\n3. Nella dashboard di Pavlovia, assicurati che lo studio sia in modalità \"IN ESECUZIONE\". Se è INATTIVO, premi il pulsante IN ESECUZIONE. Entro due secondi, lo studio passerà alla modalità IN ESECUZIONE e potrà essere eseguito normalmente. Torna alla pagina del compilatore EasyEyes e fai clic su ESEGUI, oppure utilizza l'URL dello studio.\n4. Se il tuo studio non disponibile è già in modalità ESECUZIONE, in genere significa che non hai crediti/licenza per pagare il test online. Ci sono tre modi per procedere.\n5. ESEGUI IL PILOTA GRATUITAMENTE DALLA DASHBOARD DI PAVLOVIA. Se lo desideri, puoi fare clic sul pulsante PILOTA nella dashboard di Pavlovia per mettere il tuo studio in modalità PILOTA. Esegui lo studio premendo il pulsante PILOTA (nella dashboard di Pavlovia). È gratuito, ma l'URL dello studio rimane non disponibile.\n6. ESEGUI ONLINE CON CREDITO. Per eseguire online, nella stessa dashboard puoi acquistare crediti da Pavlovia e assegnarne alcuni a questo studio. Ciò consentirà l'esecuzione online dello studio.\n7. ESEGUI ONLINE CON LICENZA. EasyEyes dispone di una licenza per Pavlovia. Scrivi a denis.pelli@nyu.edu e chiedi che il tuo indirizzo email venga incluso nella licenza del sito EasyEyes Pavlovia. (Oppure, se il tuo istituto ha una licenza del sito Pavlovia, puoi usarla). Fornisci il tuo indirizzo email alla dashboard di Pavlovia per dimostrare di essere in possesso della licenza, che Pavlovia ricorderà nelle sessioni future. Questo permetterà a tutti i tuoi studi di essere svolti online.",
