    hy: "DYMO LABEL PRINTER ՏԵՂԱԴՐՄԱՆ ՈւՂԵՑՈՒՅՑ\nՀետևեք այս քայլերին, որպեսզի օգնեք այս ուսումնասիրությանը տպել պիտակներ ձեր DYMO LabelWriter 550-ում:\n① Տեղադրեք DYMO Software\nՆերբեռնեք և տեղադրեք վերջին DYMO ծրագրակազմը ձեր ՕՀ-ի համար DYMO-ի աջակցման կայքից.\nhttps://www.dymo.com/support?cfid=user-guide\nՁեր բրաուզերում անցեք՝\nDYMO.WebApi.Mac.Host:\nՀամոզվեք, որ DYMO.WebApi.Mac.Host-ը աշխատում է:\n② Կարգավորեք ձեր զննարկիչը\n▶ Chrome\nԳնալ դեպի՝\nchrome://flags\nՈրոնեք TLS որոնման տողում:\nTLS արդյունքներից անջատեք՝\n⚬ TLS 1.3 Վաղ տվյալներ\n⚬ TLS 1.3 հետքվանտային բանալի համաձայնություն\n⚬ Օգտագործեք ML-KEM-ը TLS 1.3-ում\n⚬ Բաց թողեք TLS հաճախորդի վկայականները, եթե հավատարմագրման ռեժիմը թույլ չի տալիս:\nՍեղմեք RELAUNCH-ը ներքևում:\n▶ Firefox\nԳնացեք Կարգավորումներ → Որոնեք վկայական:\nԱնջատեք «Թույլատրել Firefox-ին ինքնաբերաբար վստահել երրորդ կողմի արմատային վկայագրերին…»\nՎերագործարկեք Firefox-ը:\n▶ Safari\nԳնալ դեպի՝\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nԵթե ​​հուշում է, ընտրեք\n«Ցույց տալ մանրամասները» → «այցելել այս կայքը»\nշրջանցելու անվտանգության նախազգուշացումը։\n③ Տպել պիտակ\nՀամոզվեք, որ DYMO.WebApi.Mac.Host-ը աշխատում է:\nԱյս էջում սեղմեք PRINT LABEL կոճակը:\n\nԽՆԴԻՐ. Եթե դեռ չեք կարողանում տպել, հաստատեք, որ DYMO.WebApi.Mac.Host-ն աշխատում է կամ դիմեք DYMO-ի պաշտոնական աջակցությանը:\nՈՒՇԱԴՐՈՒԹՅՈՒՆ. Տպելուց հետո նորից միացրեք անվտանգության ցանկացած կարգավորում՝ ձեր բրաուզերի ամենաբարձր պաշտպանությունը պահպանելու համար:",
    bg: "РЪКОВОДСТВО ЗА ИНСТАЛИРАНЕ НА ПРИНТЕР ЗА ЕТИКЕТИ DYMO\nСледвайте тези стъпки, за да помогнете на това проучване да отпечата етикети на вашия DYMO LabelWriter 550.\n① Инсталирайте софтуера DYMO\nИзтеглете и инсталирайте най-новия софтуер DYMO за вашата операционна система от уебсайта за поддръжка на DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nВъв вашия браузър отидете на:\nDYMO.WebApi.Mac.Host:\nУверете се, че DYMO.WebApi.Mac.Host работи.\n② Конфигурирайте своя браузър\n▶ Chrome\nОтидете на:\nchrome://flags\nПотърсете TLS в лентата за търсене.\nОт TLS резултатите деактивирайте:\n⚬ TLS 1.3 Ранни данни\n⚬ TLS 1.3 споразумение за постквантов ключ\n⚬ Използвайте ML-KEM в TLS 1.3\n⚬ Пропуснете TLS клиентските сертификати, ако режимът на идентификационни данни не позволява.\nЩракнете върху РЕСТАРТИРАНЕ в долната част.\n▶ Firefox\nОтидете в Настройки → Търсене на сертификат.\nПремахнете отметката от „Разрешаване на Firefox автоматично да се доверява на основни сертификати на трети страни...“\nРестартирайте Firefox.\n▶ Сафари\nОтидете на:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nАко бъдете подканени, изберете\n„Покажи подробности“ → „посетете този уебсайт“\nза да заобиколите предупреждението за сигурност.\n③ Отпечатайте етикет\nУверете се, че DYMO.WebApi.Mac.Host работи.\nНатиснете бутона ПЕЧАТ НА ЕТИКЕТ на тази страница.\n\nПРОБЛЕМ: Ако все още не можете да печатате, потвърдете, че DYMO.WebApi.Mac.Host работи или се консултирайте с официалната поддръжка на DYMO.\nВНИМАНИЕ: Активирайте отново всички настройки за сигурност след отпечатване, за да поддържате най-високата защита на вашия браузър.",
    "zh-CN":
      "DYMO 标签打印机安装指南\n请按照以下步骤操作，以帮助本研究在您的 DYMO LabelWriter 550 上打印标签。\n① 安装 DYMO 软件\n从 DYMO 支持网站下载并安装适用于您操作系统的最新 DYMO 软件：\nhttps://www.dymo.com/support?cfid=user-guide\n在您的浏览器中，访问：\nDYMO.WebApi.Mac.Host:\n确保 DYMO.WebApi.Mac.Host 正在运行。\n② 配置您的浏览器\n▶ Chrome\n访问：\nchrome://flags\n在搜索栏中搜索“TLS”。\n在 TLS 结果中，禁用：\n⚬ TLS 1.3 早期数据\n⚬ TLS 1.3 后量子密钥协议\n⚬ 在 TLS 1.3 中使用 ML-KEM\n⚬ 如果凭据模式不允许，则忽略 TLS 客户端证书。\n点击底部的“重新启动”。\n▶ Firefox\n前往“设置”→“搜索证书”。\n取消勾选“允许 Firefox 自动信任第三方根证书...”。\n重启 Firefox。\n▶ Safari\n前往：\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\n如果出现提示，请选择\n“显示详细信息”→“访问此网站”\n以绕过安全警告。\n③ 打印标签\n确保 DYMO.WebApi.Mac.Host 正在运行。\n点击此页面上的“打印标签”按钮。\n\n问题：如果仍然无法打印，请确认 DYMO.WebApi.Mac.Host 正在运行，或咨询 DYMO 官方支持。\n注意：打印后请重新启用所有安全设置，以保持浏览器的最高安全级别。",
