    hr: "Loading...",
    cs: "PRŮVODCE INSTALACÍ TISKÁRNY ŠTÍTKŮ DYMO\nChcete-li pomoci této studii tisknout štítky na zařízení DYMO LabelWriter 550, postupujte podle následujících kroků.\n① Nainstalujte DYMO Software\nStáhněte a nainstalujte nejnovější software DYMO pro váš operační systém z webu podpory DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nV prohlížeči přejděte na:\nDYMO.WebApi.Mac.Host:\nUjistěte se, že je spuštěn DYMO.WebApi.Mac.Host.\n② Nakonfigurujte svůj prohlížeč\n▶ Chrome\nPřejít na:\nchrome://flags\nNa vyhledávacím panelu vyhledejte TLS.\nVe výsledcích TLS deaktivujte:\n⚬ První data TLS 1.3\n⚬ Dohoda o postkvantovém klíči TLS 1.3\n⚬ Použijte ML-KEM v TLS 1.3\n⚬ Pokud to režim pověření neumožňuje, vynechejte klientské certifikáty TLS.\nKlikněte na RELAUNCH dole.\n▶ Firefox\nPřejděte do Nastavení → Hledat certifikát.\nZrušte zaškrtnutí políčka „Povolit Firefoxu automaticky důvěřovat kořenovým certifikátům třetích stran...“\nRestartujte Firefox.\n▶ Safari\nPřejít na:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nPokud budete vyzváni, vyberte\n“Zobrazit podrobnosti” → “navštívit tento web”\nobejít bezpečnostní varování.\n③ Vytiskněte štítek\nUjistěte se, že je spuštěn DYMO.WebApi.Mac.Host.\nNa této stránce stiskněte tlačítko PRINT LABEL.\n\nPROBLÉM: Pokud stále nemůžete tisknout, zkontrolujte, zda je spuštěn DYMO.WebApi.Mac.Host, nebo se obraťte na oficiální podporu DYMO.\nUPOZORNĚNÍ: Po tisku znovu povolte veškerá nastavení zabezpečení, aby byla zachována nejvyšší ochrana vašeho prohlížeče.",
    da: "Loading...",
    nl: 'INSTALLATIEGIDS VOOR DYMO LABELPRINTER\nVolg deze stappen om deze studie te helpen bij het afdrukken van labels op uw DYMO LabelWriter 550.\n① Installeer DYMO-software\nDownload en installeer de nieuwste DYMO-software voor uw besturingssysteem vanaf de DYMO-ondersteuningswebsite:\nhttps://www.dymo.com/support?cfid=user-guide\nGa in uw browser naar:\nDYMO.WebApi.Mac.Host:\nZorg ervoor dat DYMO.WebApi.Mac.Host actief is.\n② Configureer uw browser\n▶ Chrome\nGa naar:\nchrome://flags\nZoek naar TLS in de zoekbalk.\nSchakel in de TLS-resultaten het volgende uit:\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 post-quantum key agreement\n⚬ Gebruik ML-KEM in TLS 1.3\n⚬ Laat TLS-clientcertificaten weg als de referentiemodus dit niet toestaat. Klik onderaan op OPNIEUW STARTEN.\n▶ Firefox\nGa naar Instellingen → Zoeken naar certificaat.\n\nVink "Sta Firefox toe automatisch rootcertificaten van derden te vertrouwen..." uit.\n\nStart Firefox opnieuw op.\n▶ Safari\nGa naar:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nKies indien gevraagd\n"Details weergeven" → "Deze website bezoeken"\nom de beveiligingswaarschuwing te omzeilen.\n③ Een label afdrukken\nZorg ervoor dat DYMO.WebApi.Mac.Host actief is.\nKlik op de knop LABEL AFDRUKKEN op deze pagina.\n\nPROBLEEM: Als u nog steeds niet kunt afdrukken, controleer dan of DYMO.WebApi.Mac.Host actief is of raadpleeg de officiële DYMO-ondersteuning.\nLET OP: Schakel na het afdrukken alle beveiligingsinstellingen opnieuw in om de beste bescherming in uw browser te behouden.',
    "en-UK":
      "DYMO LABEL PRINTER INSTALLATION GUIDE\nFollow these steps to help this study print labels on your DYMO LabelWriter 550.\n① Install DYMO Software\nDownload & Install the latest DYMO software for your OS from the DYMO support website:\nhttps://www.dymo.com/support?cfid=user-guide\nIn your browser, go to:\nDYMO.WebApi.Mac.Host:\nMake sure that DYMO.WebApi.Mac.Host is running.\n② Configure Your Browser\n▶ Chrome\nGo to:\nchrome://flags\nSearch for TLS in the search bar.\nFrom the TLS results, disable:\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 post-quantum key agreement\n⚬ Use ML-KEM in TLS 1.3\n⚬ Omit TLS client certificates if credential mode disallows.\nClick RELAUNCH at the bottom.\n▶ Firefox\nGo to Settings → Search for Certificate.\nUncheck “Allow Firefox to automatically trust third-party root certificates...”\nRestart Firefox.\n▶ Safari\nGo to:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nIf prompted, choose\n“Show Details” → “visit this website”\nto bypass the security warning.\n③ Print a Label\nMake sure that DYMO.WebApi.Mac.Host is running.\nPress the PRINT LABEL button in on this page.\n\nPROBLEM: If you still can’t print, confirm that DYMO.WebApi.Mac.Host is running or consult official DYMO support.\nCAUTION: Re-enable any security settings after printing to maintain the highest protection on your browser.",
    fi: "Loading...",
    fr: "GUIDE D'INSTALLATION DE L'IMPRIMANTE D'ÉTIQUETTES DYMO\nSuivez ces étapes pour faciliter l'impression d'étiquettes sur votre DYMO LabelWriter 550.\n① Installer le logiciel DYMO\nTéléchargez et installez la dernière version du logiciel DYMO pour votre système d'exploitation depuis le site web d'assistance DYMO :\nhttps://www.dymo.com/support?cfid=user-guide\nDans votre navigateur, accédez à :\nDYMO.WebApi.Mac.Host :\nAssurez-vous que DYMO.WebApi.Mac.Host est actif.\n② Configurer votre navigateur\n▶ Chrome\nAccédez à :\nchrome://flags\nRecherchez TLS dans la barre de recherche.\nDans les résultats TLS, désactivez :\n⚬ Données préliminaires TLS 1.3\n⚬ Accord de clé post-quantique TLS 1.3\n⚬ Utiliser ML-KEM dans TLS 1.3\n⚬ Ignorer les certificats clients TLS si le mode d'identification l'interdit.\nCliquez sur RELANCER en bas.\n▶ Firefox\nAccédez à Paramètres → Rechercher un certificat.\nDécochez « Autoriser Firefox à approuver automatiquement les certificats racines tiers… ».\nRedémarrez Firefox.\n▶ Safari\nAccédez à :\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nSi vous y êtes invité, choisissez « Afficher les détails » → « Visiter ce site web »\npour ignorer l'avertissement de sécurité.\n3. Imprimer une étiquette\nAssurez-vous que DYMO.WebApi.Mac.Host est en cours d'exécution.\nCliquez sur le bouton IMPRIMER L'ÉTIQUETTE sur cette page.\n\nPROBLÈME : Si vous ne parvenez toujours pas à imprimer, vérifiez que DYMO.WebApi.Mac.Host est en cours d'exécution ou consultez l'assistance officielle DYMO.\nATTENTION : Réactivez les paramètres de sécurité après l'impression pour maintenir une protection optimale sur votre navigateur.",
