    is: "Loading...",
    id: "PANDUAN PEMASANGAN PRINTER LABEL DYMO\nIkuti langkah-langkah berikut untuk membantu studi ini mencetak label pada DYMO LabelWriter 550 Anda.\n① Instal Perangkat Lunak DYMO\nUnduh & Instal perangkat lunak DYMO terbaru untuk OS Anda dari situs web dukungan DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nDi browser Anda, buka:\nDYMO.WebApi.Mac.Host:\nPastikan DYMO.WebApi.Mac.Host berjalan.\n② Konfigurasikan Browser Anda\n▶ Chrome\nBuka:\nchrome://flags\nCari TLS di bilah pencarian. Dari hasil TLS, nonaktifkan:\n⚬ Data Awal TLS 1.3\n⚬ Perjanjian kunci pascakuantum TLS 1.3\n⚬ Gunakan ML-KEM di TLS 1.3\n⚬ Abaikan sertifikat klien TLS jika mode kredensial tidak mengizinkan.\nKlik RELAUNCH di bagian bawah.\n▶ Firefox\nBuka Setelan → Cari Sertifikat.\nHapus centang “Izinkan Firefox untuk secara otomatis memercayai sertifikat akar pihak ketiga...”\nMulai ulang Firefox.\n▶ Safari\nBuka:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nJika diminta, pilih\n“Tampilkan Detail” → “kunjungi situs web ini”\nuntuk melewati peringatan keamanan.\n③ Cetak Label\nPastikan DYMO.WebApi.Mac.Host sedang berjalan.\nTekan tombol PRINT LABEL di halaman ini.\n\nMASALAH: Jika Anda masih tidak dapat mencetak, konfirmasikan bahwa DYMO.WebApi.Mac.Host sedang berjalan atau hubungi dukungan resmi DYMO.\nPERHATIAN: Aktifkan kembali semua pengaturan keamanan setelah mencetak untuk mempertahankan perlindungan tertinggi pada peramban Anda.",
    it: "Loading...",
    ja: "DYMOラベルプリンター インストールガイド\nDYMO LabelWriter 550でラベル印刷を行うには、以下の手順に従ってください。\n① DYMOソフトウェアのインストール\nDYMOサポートウェブサイトから、お使いのOSに対応した最新のDYMOソフトウェアをダウンロードしてインストールしてください。\nhttps://www.dymo.com/support?cfid=user-guide\nブラウザで次のURLにアクセスしてください。\nDYMO.WebApi.Mac.Host\nDYMO.WebApi.Mac.Hostが実行中であることを確認してください。\n② ブラウザの設定\n▶ Chrome\n次のURLにアクセスしてください。\nchrome://flags\n検索バーで「TLS」を検索してください。\nTLSの結果から、以下の項目を無効にしてください。\n⚬ TLS 1.3 初期データ\n⚬ TLS 1.3 耐量子鍵配送\n⚬ TLS 1.3でML-KEMを使用する\n⚬ 認証モードで許可されていない場合は、TLSクライアント証明書を省略する\n⚬ 画面下部の「再起動」をクリックしてください。\n▶ Firefox\n「設定」→「証明書を検索」に移動します。\n「Firefox がサードパーティのルート証明書を自動的に信頼できるようにする」のチェックを外します。\nFirefox を再起動します。\n▶ Safari\n次の URL にアクセスします：\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nセキュリティ警告が表示された場合は、「詳細を表示」→「この Web サイトにアクセス」を選択し、セキュリティ警告を回避します。\n③ ラベルを印刷する\nDYMO.WebApi.Mac.Host が実行中であることを確認します。\nこのページの「ラベルを印刷」ボタンを押します。\n\n問題：それでも印刷できない場合は、DYMO.WebApi.Mac.Host が実行中であることを確認するか、DYMO 公式サポートにお問い合わせください。\n注意：ブラウザのセキュリティを最高レベルに保つため、印刷後はセキュリティ設定を再度有効にしてください。",
