    pl: "Nie można połączyć się z MMM. Być może przeglądarka telefonu (BBB) ​​jest zbyt stara. W takim przypadku pomocne może być uaktualnienie systemu operacyjnego telefonu. Lub zainstaluj przeglądarkę Chrome i ustaw ją jako domyślną przeglądarkę.\n• Następnie ponownie skieruj aparat telefonu na powyższy kod QR.\n• Aby wypróbować inny telefon, po prostu odśwież tę stronę: Kliknij ↻ lub kliknij pasek adresu i naciśnij RETURN.",
