    ru: "Loading...",
    sr: "Повезивање са вашим МММ-ом није успело. Можда је претраживач телефона (БББ) престар. У том случају може помоћи надоградња оперативног система телефона. Или инсталирајте Цхроме претраживач и поставите га као подразумевани претраживач.\n• Затим, још једном, усмерите камеру телефона на КР код изнад.\n• Да бисте пробали други телефон, само освежите ову страницу: Кликните на ↻ или кликните на траку за адресу и притисните РЕТУРН.",
