    pt: 'SEU TELEFONE Google. Precisamos de detalhes especificando o modelo. Acesse Configurações > Sobre o telefone (anteriormente "Sobre o dispositivo"). Copie o Modelo e o Número do modelo nos campos correspondentes abaixo. Em telefones mais antigos, pressione Status para ver essas informações.',
    ro: "Loading...",
    ru: "ВАШ ТЕЛЕФОН Google. Нам нужны данные, указывающие его модель. Перейдите в Настройки > О телефоне (ранее «Об устройстве»). Скопируйте Модель и Номер модели в соответствующие поля ниже. На старых телефонах нажмите Статус, чтобы увидеть эту информацию.",
