    sv: 'DIN Google-TELEFON. Vi behöver detaljer som specificerar dess modell. Gå till Inställningar > Om telefonen (tidigare "Om enheten"). Kopiera modell- och modellnummer till motsvarande fält nedan. På äldre telefoner trycker du på Status för att se denna information.',
