    hr: 'VAŠ Motorola TELEFON. Trebaju nam detalji koji određuju njegov model. Idite na Postavke > O telefonu (prije "O uređaju"). Model IME i (BROJ) kombinirani su u jedan red pod nazivom "Model". Kopirajte naziv ispred zagrada u Naziv modela ispod. Kopirajte slova i brojeve unutar zagrada u broj modela ispod.',
