    nl: "Loading...",
    "en-UK": "Loading...",
    fi: 'SINUN Motorola-PUHELIN. Tarvitsemme yksityiskohtaisia ​​tietoja sen mallista. Siirry kohtaan Asetukset > Tietoja puhelimesta (aiemmin "Tietoja laitteesta"). Malli NIMI ja (NUMBER) on yhdistetty yhdeksi riviksi nimeltä "Malli". Kopioi sulkuja edeltävä nimi alla olevaan mallin nimeen. Kopioi suluissa olevat kirjaimet ja numerot alla olevaan mallinumeroon.',
    fr: "Loading...",
    de: "IHR Motorola-TELEFON. Wir benötigen Angaben zum Modell. Gehen Sie zu Einstellungen > Telefoninfo (früher „Geräteinfo“). Modellname und (Nummer) werden in einer Zeile mit dem Namen „Modell“ zusammengefasst. Kopieren Sie den Namen vor den Klammern in den Modellnamen. Kopieren Sie die Buchstaben und Zahlen in den Klammern in die Modellnummer.",
    el: 'ΤΟ ΤΗΛΕΦΩΝΟ ΣΑΣ Motorola. Χρειαζόμαστε λεπτομέρειες που να προσδιορίζουν το μοντέλο του. Μεταβείτε στις Ρυθμίσεις > Σχετικά με το τηλέφωνο (πρώην "Σχετικά με τη συσκευή"). Το μοντέλο NAME και (NUMBER) συνδυάζονται σε μια γραμμή που ονομάζεται "Μοντέλο". Αντιγράψτε το όνομα πριν από τις παρενθέσεις στο όνομα μοντέλου παρακάτω. Αντιγράψτε τα γράμματα και τους αριθμούς μέσα στις παρενθέσεις στον αριθμό μοντέλου παρακάτω.',
    he: "Loading...",
    hi: 'आपका मोटोरोला फ़ोन। हमें इसके मॉडल को निर्दिष्ट करने वाले विवरण की आवश्यकता है। सेटिंग्स > फ़ोन के बारे में (पूर्व में "डिवाइस के बारे में") पर जाएँ। मॉडल का नाम और (संख्या) एक पंक्ति में संयुक्त हैं जिसे "मॉडल" कहा जाता है। कोष्ठक से पहले नाम को नीचे मॉडल नाम में कॉपी करें। कोष्ठक के अंदर अक्षरों और संख्याओं को नीचे मॉडल नंबर में कॉपी करें।',
    hu: 'AZ ÖN Motorola TELEFONJA. Részletekre van szükségünk a modell meghatározásához. Nyissa meg a Beállítások > A telefonról menüpontot (korábban "Az eszközről"). A NÉV és a (NUMBER) modell egy „Model” nevű sorban van egyesítve. Másolja a zárójel előtti nevet az alábbi modellnévbe. Másolja a zárójelben lévő betűket és számokat az alábbi modellszámba.',
    is: 'Motorola SÍMINN ÞINN. Við þurfum smáatriði sem tilgreina líkan þess. Farðu í Stillingar > Um símann (áður „Um tæki“). Fyrirmyndin NAME og (NUMBER) eru sameinuð í eina línu sem kallast "Model". Afritaðu nafnið á undan svigunum í líkanið fyrir neðan. Afritaðu stafina og tölustafina innan sviga í tegundarnúmerið hér að neðan.',
    id: "Loading...",
    it: 'IL TUO TELEFONO Motorola. Abbiamo bisogno di dettagli che ne specifichino il modello. Vai a Impostazioni > Info sul telefono (in precedenza "Info sul dispositivo"). Il NOME e il (NUMERO) del modello sono combinati in un\'unica riga chiamata "Modello". Copia il nome prima delle parentesi nel Nome modello qui sotto. Copia le lettere e i numeri tra parentesi nel Numero modello qui sotto.',
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "JŪSŲ „Motorola“ TELEFONAS. Mums reikia detalių, nurodančių jos modelį. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Modelis PAVADINIMAS ir (NUMBER) yra sujungti į vieną eilutę, pavadintą „Modelis“. Nukopijuokite pavadinimą prieš skliaustus į žemiau esantį modelio pavadinimą. Nukopijuokite raides ir skaičius skliausteliuose į žemiau esantį modelio numerį.",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: 'تلفن موتورولا شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به تنظیمات > درباره تلفن (قبلاً «درباره دستگاه») بروید. مدل NAME و (NUMBER) در یک خط به نام "Model" ترکیب می شوند. نام را قبل از پرانتز در نام مدل زیر کپی کنید. حروف و اعداد داخل پرانتز را در شماره مدل زیر کپی کنید.',
    pl: "TWÓJ TELEFON Motorola. Potrzebujemy szczegółów określających jego model. Przejdź do Ustawienia > Informacje o telefonie (dawniej „Informacje o urządzeniu”). NAZWA modelu i (NUMER) są połączone w jeden wiersz o nazwie „Model”. Skopiuj nazwę przed nawiasami do nazwy modelu poniżej. Skopiuj litery i cyfry w nawiasach do numeru modelu poniżej.",
