    sv: "Loading...",
    tl: 'IYONG Xiaomi PHONE. Kailangan namin ng mga detalye na tumutukoy sa modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono (dating "Tungkol sa device"). Kopyahin ang pangalan ng Modelo (hal. "Xiaomi Mi 10", "Redmi Note 10", "Poco X3", o "Black Shark 4") at Numero ng Modelo sa mga kaukulang field sa ibaba. Sa mas lumang mga telepono pindutin ang Status upang makita ang impormasyong ito.',
    tr: 'Xiaomi TELEFONUNUZ. Modelini belirten ayrıntılara ihtiyacımız var. Ayarlar > Telefon hakkında (eski adıyla "Cihaz hakkında") bölümüne gidin. Model adını (ör. "Xiaomi Mi 10", "Redmi Note 10", "Poco X3" veya "Black Shark 4") ve Model numarasını aşağıdaki ilgili alanlara kopyalayın. Daha eski telefonlarda bu bilgileri görmek için Durum\'a basın.',
    ur: 'آپ کا Xiaomi فون۔ ہمیں اس کے ماڈل کی تفصیلات کی ضرورت ہے۔ ترتیبات > فون کے بارے میں (پہلے "آلہ کے بارے میں") پر جائیں۔ ماڈل کا نام (مثال کے طور پر "Xiaomi Mi 10"، "Redmi Note 10" "Poco X3"، یا "Black Shark 4") اور ماڈل نمبر کو ذیل میں متعلقہ فیلڈز میں کاپی کریں۔ پرانے فونز پر اس معلومات کو دیکھنے کے لیے اسٹیٹس کو دبائیں۔',
