    hi: 'आपका ब्लैकबेरी फ़ोन। हमें इसके मॉडल को निर्दिष्ट करने वाले विवरण की आवश्यकता है। सेटिंग्स > फ़ोन के बारे में (पूर्व में "डिवाइस के बारे में") पर जाएँ। मॉडल का नाम और (संख्या) एक पंक्ति में संयुक्त हैं जिसे "मॉडल" कहा जाता है। कोष्ठक से पहले नाम को नीचे मॉडल नाम में कॉपी करें। कोष्ठक के अंदर अक्षरों और संख्याओं को नीचे मॉडल नंबर में कॉपी करें।',
    hu: "Loading...",
    is: "Loading...",
    id: 'TELEPON Blackberry ANDA. Kami memerlukan detail yang menyebutkan modelnya. Buka Setelan > Tentang ponsel (sebelumnya "Tentang perangkat"). NAMA model dan (NOMOR) digabungkan menjadi satu baris yang disebut "Model". Salin nama sebelum tanda kurung ke Nama model di bawah. Salin huruf dan angka di dalam tanda kurung ke Nomor model di bawah.',
    it: "Loading...",
    ja: "Blackberryスマートフォン。機種を特定する詳細情報が必要です。「設定」>「端末情報」（旧「端末情報」）に移動してください。機種名と（番号）は「モデル」という1行にまとめられています。括弧の前の名称を以下の「モデル名」にコピーしてください。括弧内の文字と数字を以下の「モデル番号」にコピーしてください。",
    kn: 'ನಿಮ್ಮ ಬ್ಲ್ಯಾಕ್‌ಬೆರಿ ಫೋನ್. ಅದರ ಮಾದರಿಯನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ವಿವರಗಳು ನಮಗೆ ಅಗತ್ಯವಿದೆ. ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಫೋನ್ ಕುರಿತು (ಹಿಂದೆ "ಸಾಧನದ ಕುರಿತು") ಗೆ ಹೋಗಿ. ಮಾದರಿ NAME ಮತ್ತು (NUMBER) ಅನ್ನು "ಮಾದರಿ" ಎಂಬ ಒಂದು ಸಾಲಿನಲ್ಲಿ ಸಂಯೋಜಿಸಲಾಗಿದೆ. ಆವರಣದ ಮೊದಲು ಹೆಸರನ್ನು ಕೆಳಗಿನ ಮಾದರಿ ಹೆಸರಿಗೆ ನಕಲಿಸಿ. ಆವರಣದಲ್ಲಿರುವ ಅಕ್ಷರಗಳು ಮತ್ತು ಸಂಖ್ಯೆಗಳನ್ನು ಕೆಳಗಿನ ಮಾದರಿ ಸಂಖ್ಯೆಗೆ ನಕಲಿಸಿ.',
    ko: '블랙베리 휴대폰입니다. 모델 정보를 입력해 주세요. 설정 > 휴대폰 정보(이전 명칭: "기기 정보")로 이동하세요. 모델명과 (번호)가 합쳐져 ​​"모델"이라는 한 줄에 표시됩니다. 괄호 앞의 모델명을 아래 모델명에 복사하세요. 괄호 안의 문자와 숫자를 아래 모델 번호에 복사하세요.',
    lt: "JŪSŲ „Blackberry“ TELEFONAS. Mums reikia detalių, nurodančių jos modelį. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Modelis PAVADINIMAS ir (NUMBER) yra sujungti į vieną eilutę, pavadintą „Modelis“. Nukopijuokite pavadinimą prieš skliaustus į žemiau esantį modelio pavadinimą. Nukopijuokite raides ir skaičius skliausteliuose į žemiau esantį modelio numerį.",
    ms: 'TELEFON Blackberry ANDA. Kami memerlukan butiran yang menyatakan modelnya. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Model NAME dan (NUMBER) digabungkan menjadi satu baris yang dipanggil "Model". Salin nama sebelum kurungan ke nama Model di bawah. Salin huruf dan nombor di dalam kurungan ke nombor Model di bawah.',
    ml: 'നിങ്ങളുടെ ബ്ലാക്ക്‌ബെറി ഫോൺ. അതിൻ്റെ മാതൃക വ്യക്തമാക്കുന്ന വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ക്രമീകരണങ്ങൾ > ഫോണിനെക്കുറിച്ച് (മുമ്പ് "ഉപകരണത്തെക്കുറിച്ച്") എന്നതിലേക്ക് പോകുക. മോഡൽ NAME ഉം (NUMBER) ഉം "മോഡൽ" എന്ന് വിളിക്കപ്പെടുന്ന ഒരു വരിയായി സംയോജിപ്പിച്ചിരിക്കുന്നു. പരാൻതീസിസിന് മുമ്പുള്ള പേര് ചുവടെയുള്ള മോഡൽ നാമത്തിലേക്ക് പകർത്തുക. പരാൻതീസിസിനുള്ളിലെ അക്ഷരങ്ങളും അക്കങ്ങളും ചുവടെയുള്ള മോഡൽ നമ്പറിലേക്ക് പകർത്തുക.',
    no: 'DIN Blackberry-TELEFON. Vi trenger detaljer som spesifiserer modellen. Gå til Innstillinger > Om telefonen (tidligere «Om enheten»). Modellen NAME og (NUMBER) er kombinert til én linje kalt "Model". Kopier navnet før parentesen til modellnavnet nedenfor. Kopier bokstavene og tallene innenfor parentes til modellnummeret nedenfor.',
    fa: 'تلفن Blackberry شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به تنظیمات > درباره تلفن (قبلاً «درباره دستگاه») بروید. مدل NAME و (NUMBER) در یک خط به نام "Model" ترکیب می شوند. نام را قبل از پرانتز در نام مدل زیر کپی کنید. حروف و اعداد داخل پرانتز را در شماره مدل زیر کپی کنید.',
    pl: "Loading...",
    pt: 'SEU TELEFONE Blackberry. Precisamos de detalhes especificando o modelo. Acesse Configurações > Sobre o telefone (anteriormente "Sobre o dispositivo"). O NOME e o (NÚMERO) do modelo são combinados em uma linha chamada "Modelo". Copie o nome antes dos parênteses para o Nome do modelo abaixo. Copie as letras e os números dentro dos parênteses para o Número do modelo abaixo.',
    ro: "Loading...",
    ru: "ВАШ ТЕЛЕФОН Blackberry. Нам нужны данные, указывающие его модель. Перейдите в Настройки > О телефоне (ранее «Об устройстве»). НАЗВАНИЕ модели и (НОМЕР) объединены в одну строку под названием «Модель». Скопируйте имя перед скобками в поле Название модели ниже. Скопируйте буквы и цифры внутри скобок в поле Номер модели ниже.",
    sr: "Loading...",
    es: 'SU TELÉFONO Blackberry. Necesitamos detalles que especifiquen su modelo. Vaya a Ajustes > Acerca del teléfono (anteriormente "Acerca del dispositivo"). El NOMBRE y el NÚMERO del modelo se combinan en una sola línea llamada "Modelo". Copie el nombre antes del paréntesis en "Nombre del modelo" (abajo). Copie las letras y los números dentro del paréntesis en "Número de modelo" (abajo).',
