    ru: "Loading...",
    sr: "ВАШ Мацинтосх РАЧУНАР. Потребни су нам детаљи који прецизирају његов модел. Док држите тастер Оптион, идите на Аппле мени  > Информације о систему.  Из Прегледа хардвера копирајте назив модела и идентификатор модела у одговарајућа поља испод.",
    es: "Loading...",
    sw: "Loading...",
    sv: "DIN Macintosh DATOR. Vi behöver detaljer som specificerar dess modell. Medan du trycker på alternativtangenten går du till Apple-menyn  > Systeminformation.  Från maskinvaruöversikten kopierar du modellnamnet och modellidentifieraren till motsvarande fält nedan.",
