    ar: 'هاتف Palm الخاص بك. نحتاج إلى تفاصيل طرازه. انتقل إلى قائمة الإعدادات أو الخيارات، ثم انتقل إلى أسفل القائمة، وحدد "حول الهاتف" أو "حول الجهاز" أو ما شابه. انسخ اسم الطراز ورقمه في الحقول المقابلة أدناه.',
