    hy: "⚠ Ստուգման ցուցակ\n1. Նայեք վերևում. Արդյո՞ք մենք օգտագործում ենք ճիշտ բարձրախոսներ և խոսափող:\n2. ⇧🔊 Համակարգչի ձայնի ծավալը պետք է լինի առավելագույնը։\n3. Բոլոր ականջակալները/ականջակալները պետք է հանվեն և անջատվեն:\n4. Հեռախոսի պատյանը պետք է հանվի:\nՑանկացած խնդրի դեպքում պարզապես սեղմեք ՎԵՐՍԿՍԵԼ Ձայնագրումը, ուղղեք այն և ՇԱՐՈՒՆԱԿԵԼ:",
    bg: "⚠ КОНТРОЛЕН СПИСЪК\n1. Погледнете по-горе: Използваме ли правилните високоговорители и микрофон?\n2. ⇧🔊 Силата на звука на компютъра трябва да е максимална.\n3. Всички слушалки/тапи трябва да бъдат отстранени и изключени.\n4. Калъфът на телефона трябва да се свали.\nЗа всеки проблем просто щракнете върху РЕСТАРТИРАНЕ НА ЗАПИС, поправете го и ПРОДЪЛЖЕТЕ.",
    "zh-CN": "Loading...",
    "zh-HK":
      "⚠ 清單\n1. 看看上面：我們使用的揚聲器和麥克風是否正確？\n2. ⇧🔊 電腦音量要調到最大。\n3. 應取下並斷開所有耳機/耳塞。\n4. 應將手機外殼取下。\n如有任何問題，只需單擊“重新開始錄製”，修復它，然後繼續。",
    hr: "⚠ KONTROLNI POPIS\n1. Pogledajte iznad: Koristimo li prave zvučnike i mikrofon?\n2. ⇧🔊 Glasnoća zvuka računala trebala bi biti na maksimalnoj razini.\n3. Sve slušalice treba ukloniti i odspojiti.\n4. Kućište telefona treba ukloniti.\nZa bilo kakav problem, samo kliknite PONOVNO POKRENI SNIMANJE, popravite ga i NASTAVI.",
    cs: "Loading...",
    da: "⚠ CHECKLISTE\n1. Se ovenfor: Bruger vi de rigtige højttalere og mikrofon?\n2. ⇧🔊 Computerens lydstyrke skal være maksimalt.\n3. Eventuelle hovedtelefoner/øretelefoner skal fjernes og frakobles.\n4. Telefonens etui skal fjernes.\nFor ethvert problem skal du bare klikke på GENSTART OPTAGELSE, reparere det og FORTSÆT.",
    nl: "⚠ CHECKLIST\n1. Kijk hierboven: Gebruiken we de juiste luidsprekers en microfoon?\n2. ⇧🔊 Het geluidsvolume van de computer moet op maximaal staan.\n3. Eventuele koptelefoons/oordopjes moeten verwijderd en losgekoppeld zijn.\n4. Het hoesje van de telefoon moet verwijderd zijn.\nBij problemen klikt u op OPNAME OPNIEUW STARTEN, lost u het probleem op en gaat u VERDER.",
    "en-UK": "Loading...",
    fi: "⚠ TARKISTUSLISTA\n1. Katso yllä: Käytämmekö oikeita kaiuttimia ja mikrofonia?\n2. ⇧🔊 Tietokoneen äänenvoimakkuuden tulee olla maksimissaan.\n3. Kaikki kuulokkeet/nappikuulokkeet tulee poistaa ja irrottaa.\n4. Puhelimen kotelo tulee poistaa.\nJos sinulla on ongelmia, napsauta vain KÄYNNISTÄ TALLENNUS UUDELLEEN, korjaa se ja JATKA.",
    fr: "⚠ LISTE DE CONTRÔLE\n1. Vérifiez ci-dessus : utilisons-nous les bons haut-parleurs et le bon microphone ?\n2. ⇧🔊 Le volume de l’ordinateur doit être au maximum.\n3. Tous les écouteurs doivent être retirés et débranchés.\n4. La coque du téléphone doit être retirée.\nEn cas de problème, cliquez simplement sur « REDÉMARRER L’ENREGISTREMENT », corrigez-le et CONTINUEZ.",
    de: "⚠ CHECKLISTE\n1. Siehe oben: Verwenden wir die richtigen Lautsprecher und das richtige Mikrofon?\n2. ⇧🔊 Die Lautstärke des Computers sollte auf Maximum eingestellt sein.\n3. Kopfhörer/Ohrhörer sollten entfernt und getrennt werden.\n4. Die Handyhülle sollte entfernt werden.\nBei Problemen einfach auf „AUFNAHME NEU STARTEN“ klicken, das Problem beheben und FORTFAHREN.",
    el: "⚠ ΛΙΣΤΑ ΕΛΕΓΧΟΥ\n1. Κοιτάξτε παραπάνω: Χρησιμοποιούμε τα σωστά μεγάφωνα και μικρόφωνο;\n2. ⇧🔊 Η ένταση ήχου του υπολογιστή πρέπει να είναι στο μέγιστο.\n3. Τυχόν ακουστικά/ψείρες θα πρέπει να αφαιρεθούν και να αποσυνδεθούν.\n4. Η θήκη του τηλεφώνου πρέπει να αφαιρεθεί.\nΓια οποιοδήποτε πρόβλημα, απλώς κάντε κλικ στο ΕΠΑΝΕΚΚΙΝΗΣΗ ΕΓΓΡΑΦΗΣ, διορθώστε το και ΣΥΝΕΧΙΣΤΕ.",
    he: "Loading...",
    hi: "Loading...",
    hu: "⚠ ELLENŐRZŐ LISTA\n1. Nézd meg fent: Megfelelő hangszórókat és mikrofont használunk?\n2. ⇧🔊 A számítógép hangereje legyen a maximumon.\n3. Minden fejhallgatót/fülhallgatót el kell távolítani és le kell választani.\n4. Távolítsa el a telefon tokját.\nBármilyen probléma esetén kattintson a RÖGZÍTÉS ÚJRA INDÍTÁSA lehetőségre, javítsa ki, és FOLYTATJA.",
    is: "⚠ GATSLISTI\n1. Horfðu að ofan: Erum við að nota rétta hátalara og hljóðnema?\n2. ⇧🔊 Hljóðstyrkur tölvunnar ætti að vera í hámarki.\n3. Öll heyrnartól/eyrnatól ætti að fjarlægja og aftengja.\n4. Fjarlægja ætti hulstur símans.\nFyrir hvaða vandamál sem er, smelltu bara á RESTART UPPTAKA, lagaðu það og ÁFRAM.",
    id: "Loading...",
    it: "⚠ CHECKLIST\n1. Guarda sopra: stiamo utilizzando gli altoparlanti e il microfono corretti?\n2. ⇧🔊 Il volume del computer deve essere al massimo.\n3. Eventuali cuffie/auricolari devono essere rimossi e scollegati.\n4. La custodia del telefono deve essere rimossa.\nPer qualsiasi problema, basta cliccare su RIAVVIA REGISTRAZIONE, risolvere il problema e PROCEDERE.",
    ja: "Loading...",
