    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "⚠ LISTA KONTROLNA\n1. Spójrz powyżej: Czy używamy odpowiednich głośników i mikrofonu?\n2. ⇧🔊 Głośność dźwięku komputera powinna być ustawiona na maksimum.\n3. Należy zdjąć i odłączyć słuchawki/wkładki douszne.\n4. Należy zdjąć obudowę telefonu.\nW przypadku jakichkolwiek problemów wystarczy kliknąć RESTART RECORDING, naprawić problem i KONTYNUOWAĆ.",
    pt: "Loading...",
    ro: "⚠ LISTA DE VERIFICARE\n1. Priviți mai sus: folosim difuzoarele și microfonul potrivit?\n2. ⇧🔊 Volumul sunetului computerului ar trebui să fie la maxim.\n3. Toate căștile/căștile trebuie scoase și deconectate.\n4. Carcasa telefonului trebuie scoasă.\nPentru orice problemă, faceți clic pe RESTART RECORDING, remediați-o și PROCEED.",
    ru: "⚠ КОНТРОЛЬНЫЙ СПИСОК\n1. Посмотрите выше: используем ли мы правильные динамики и микрофон?\n2. ⇧🔊 Громкость звука компьютера должна быть максимальной.\n3. Все наушники/вкладыши должны быть извлечены и отсоединены.\n4. Чехол телефона должен быть снят.\nВ случае возникновения любой проблемы просто нажмите ПЕРЕЗАПУСТИТЬ ЗАПИСЬ, устраните ее и ПРОДОЛЖАЙТЕ.",
    sr: "⚠ КОНТРОЛНА ЛИСТА\n1. Погледајте горе: Да ли користимо праве звучнике и микрофон?\n2. ⇧🔊 Јачина звука рачунара треба да буде максимална.\n3. Све слушалице/бубице треба уклонити и искључити.\n4. Кућиште телефона треба уклонити.\nЗа било који проблем, само кликните ПОНОВНО ПОКРЕНИ СНИМАЊЕ, поправи га и НАСТАВИ.",
    es: "Loading...",
    sw: "⚠ ORODHA\n1. Angalia hapo juu: Je, tunatumia vipaza sauti na maikrofoni sahihi?\n2. ⇧🔊 Sauti ya kompyuta inapaswa kuwa ya juu zaidi.\n3. Vipokea sauti vya masikioni/vipokea sauti vya masikioni vinapaswa kuondolewa na kukatwa.\n4. Kesi ya simu inapaswa kuondolewa.\nKwa tatizo lolote, bofya ANZA UPYA KUREKODI, irekebishe, na UENDELEE.",
    sv: "⚠ CHECKLISTA\n1. Se ovan: Använder vi rätt högtalare och mikrofon?\n2. ⇧🔊 Datorns ljudvolym ska vara maximalt.\n3. Eventuella hörlurar/öronsnäckor ska tas bort och kopplas bort.\n4. Telefonens fodral bör tas bort.\nFör eventuella problem, klicka bara på STARTA OM INSPELNING, fixa det och FORTSÄTT.",
    tl: "⚠ CHECKLIST\n1. Tumingin sa itaas: Ginagamit ba natin ang tamang loudspeaker at mikropono?\n2. ⇧🔊 Ang dami ng tunog ng computer ay dapat nasa maximum.\n3. Dapat tanggalin at idiskonekta ang anumang mga headphone/earbud.\n4. Dapat tanggalin ang case ng telepono.\nPara sa anumang problema, i-click lamang ang RESTART RECORDING, ayusin ito, at MAGPATULOY.",
    tr: "⚠ KONTROL LİSTESİ\n1. Yukarıya bakın: Doğru hoparlörleri ve mikrofonu mu kullanıyoruz?\n2. ⇧🔊 Bilgisayarın ses seviyesi maksimumda olmalıdır.\n3. Herhangi bir kulaklık/kulak içi kulaklık çıkarılmalı ve bağlantısı kesilmelidir.\n4. Telefonun kılıfı çıkarılmalıdır.\nHerhangi bir sorun için, KAYDI YENİDEN BAŞLAT'a tıklayın, düzeltin ve DEVAM EDİN.",
    ur: "⚠ چیک لسٹ\n1. اوپر دیکھیں: کیا ہم صحیح لاؤڈ سپیکر اور مائیکروفون استعمال کر رہے ہیں؟\n2. ⇧🔊 کمپیوٹر کی آواز کا حجم زیادہ سے زیادہ ہونا چاہیے۔\n3۔ کوئی بھی ہیڈ فون/ایئربڈز ہٹا کر منقطع کر دیے جائیں۔\n4. فون کا کیس ہٹا دیا جانا چاہیے۔\nکسی بھی مسئلے کے لیے، صرف دوبارہ شروع کریں ریکارڈنگ پر کلک کریں، اسے ٹھیک کریں، اور آگے بڑھیں۔",
