    sw: "❌ Samahani, simu inajibu polepole, na huenda ikatenganishwa. Unaweza:\n1. SUBIRI zaidi. Bonyeza kitufe cha WAIT.\n2. JARIBU TENA kwa kubofya kitufe cha CALIBRATE.\n3.BORESHA KIvinjari CHA SIMU. Vivinjari vinavyooana vya simu ni pamoja na: Safari 12+ na Chrome 133+. Je, kivinjari cha simu hii cha BBB 111 kinaweza kuwa cha zamani sana kwa uoanifu? Katika hali hiyo, unaweza kufanya simu hii ioane kwa kuboresha kivinjari chake. Ama pandisha gredi hadi toleo jipya la Mfumo wa Uendeshaji (na hivyo uboresha kivinjari chochote kilichojengewa ndani), au usakinishe kivinjari kipya, k.m. Chrome, na uifanye kuwa kivinjari chaguo-msingi. Mara tu kivinjari cha simu kikisasishwa, bonyeza kitufe cha CALIBRATE.\n4. JARIBU SIMU NYINGINE. Bonyeza kitufe cha CALIBRATE.\n5. MALIZA kipindi kwa kubofya kitufe cha EXIT.",
    sv: "❌ Tyvärr, telefonen svarar långsamt och kan vara frånkopplad. Du kan:\n1. VÄNTA längre. Klicka på knappen VÄNTA.\n2. FÖRSÖK IGEN genom att trycka på knappen CALIBRATE.\n3. UPPGRADERA TELEFONENS WEBSÄLLARE. Kompatibla telefonwebbläsare inkluderar: Safari 12+ och Chrome 133+. Kan den här telefonens webbläsare BBB 111 vara för gammal för kompatibilitet? I så fall kan du göra den här telefonen kompatibel genom att uppgradera dess webbläsare. Antingen uppgradera till en nyare OS-version (och därmed uppgradera valfri inbyggd webbläsare), eller installera en ny webbläsare, t.ex. Chrome och gör den till standardwebbläsare. När telefonens webbläsare har uppgraderats trycker du på knappen KALIBRERA.\n4. PROVA EN ANNAN TELEFON. Tryck på knappen CALIBRATE.\n5. AVSLUTA sessionen genom att trycka på EXIT-knappen.",
