    lt: "Klaviatūros ryšys nutrūko. Norėdami prisijungti iš naujo, atnaujinkite telefono naršyklės puslapį (palieskite adresą; palieskite eiti) arba nukreipkite telefono kamerą į toliau pateiktą QR kodą ir bakstelėkite telefono ekrane rodomą nuorodą.",
    ms: "Sambungan papan kekunci terputus. Untuk menyambung semula, muat semula halaman penyemak imbas telefon anda (ketik alamat; ketik pergi) atau halakan kamera telefon pada kod QR di bawah dan ketik pautan yang muncul dalam skrin telefon.",
    ml: "Loading...",
    no: "Loading...",
    fa: "اتصال صفحه کلید قطع شد. برای اتصال مجدد، صفحه مرورگر تلفن خود را بازخوانی کنید (به آدرس ضربه بزنید؛ روی Go ضربه بزنید) یا دوربین تلفن را به سمت کد QR زیر بگیرید و روی پیوندی که در صفحه تلفن ظاهر می شود ضربه بزنید.",
