    tl: "Nasira ang koneksyon sa keypad. Upang muling kumonekta, i-refresh ang page ng browser ng iyong telepono (i-tap ang address; i-tap ang go) o ituro ang camera ng telepono sa QR code sa ibaba, at i-tap ang link na lalabas sa screen ng telepono.",
    tr: "Loading...",
    ur: "کی پیڈ کا کنکشن ٹوٹ گیا۔ دوبارہ منسلک کرنے کے لیے، اپنے فون کے براؤزر کے صفحہ کو ریفریش کریں (پتہ پر ٹیپ کریں؛ جائیں پر ٹیپ کریں) یا فون کے کیمرہ کو نیچے دیئے گئے QR کوڈ پر پوائنٹ کریں، اور فون کی اسکرین پر ظاہر ہونے والے لنک کو تھپتھپائیں۔",
