    hi: "क्रॉस को पकड़ो! हमें आपकी मदद चाहिए। आई ट्रैकर को और अधिक प्रशिक्षण की आवश्यकता है। जैसा कि तीर द्वारा दिखाया गया है, जब आपने क्लिक किया, तो ट्रैकर ने सोचा कि आपकी नज़र क्रॉस से दूर है। कृपया प्रत्येक नई स्थिति पर क्रॉस पर क्लिक करें। यह एक खेल है। क्रॉस को पकड़ो!",
    hu: "Loading...",
    is: "GANGI KROSSINN! Við þurfum hjálp þína. Augnsporið þarf meiri þjálfun. Eins og örin sýnir, þegar þú smelltir, hélt rekja spor einhvers að augnaráð þitt væri langt frá krossinum. Vinsamlegast smelltu á krossinn við hverja nýja stöðu. Það er leikur. Gríptu krossinn!",
