    ko: "십자가를 잡아라! 도움이 필요해요. 시선 추적기에 훈련이 더 필요합니다. 화살표에서 알 수 있듯이, 클릭했을 때 시선 추적기는 시선이 십자가에서 멀리 떨어져 있다고 판단했습니다. 새로운 위치에서 십자가를 클릭해 주세요. 게임이에요. 십자가를 잡아라!",
    lt: "PAGAUKITE KRYŽIUS! Mums reikia jūsų pagalbos. Akių stebėjimui reikia daugiau treniruočių. Kaip rodo rodyklė, kai spustelėjote, seklys manė, kad jūsų žvilgsnis buvo toli nuo kryžiaus. Kiekvienoje naujoje vietoje spustelėkite kryžių. Tai žaidimas. Pagauk kryžių!",
