    hy: "ԹԵՍՏԱԿԱՆ ՀԵՌԱԽՈՍԸ ՄԻԱՑԱԾ Է ԻՆՏԵՐՆԵՏԻՆ:\n1. ԱՅՈ, ապա ներքևում սեղմեք OK՝ շարունակելու համար:\n2. 📶 ԲՋՋԱՅԻՆ ԾԱՌԱՅՈՒԹՅՈՒՆ. Եթե հեռախոսի բջջային ծառայությունը միանում է ինտերնետին, սեղմեք OK:\n3. 🛜 WIFI. միացրեք այն ինտերնետին Wi-Fi-ի միջոցով և սեղմեք OK:\n4. ՍՏԵՂԾԵԼ ԺԱՄԱՆԱԿԸ ԵՎ Ամսաթիվը. նոր հեռախոսը կամ հին հեռախոսը, որը վերակայվել է, չունի բջջային ծառայության հաշիվ և սխալ ամսաթիվ: Ժամն ու ամսաթիվը սահմանելուց հետո այն կաշխատի թեժ կետի/միացման հետ, ինչպես բացատրվում է հաջորդիվ:\n5. HOTSPOT. Եթե փորձնական հեռախոսը ձեր անձնական հեռախոսը չէ, և ձեր անձնական հեռախոսն ունի ինտերնետ, ապա երկու հեռախոսները կարող են համօգտագործել ինտերնետ հասանելիությունը: Հեռախոսները միացրեք միմյանց Wi-Fi-ի, Bluetooth-ի կամ USB-ի միջոցով.\n    * 🛜 Wi-Fi թեժ կետ. Եթե ձեր անձնական հեռախոսը միացված է ինտերնետին բջջային ծառայության միջոցով, այն կարող է Wi-Fi թեժ կետ տրամադրել փորձարկման հեռախոսին: Միանալուց հետո սեղմեք OK:\n    * >ᛒ Bluetooth Tethering. Եթե ձեր անձնական հեռախոսն օգտագործում է Wi-Fi ինտերնետ հասանելիության համար, այն կարող է համօգտագործել ինտերնետ հասանելիությունը Bluetooth-ի միջոցով: Միացրեք Bluetooth-ը (iPhone-ում) կամ Bluetooth-ի կապը (Android-ում) երկու հեռախոսներում, զուգակցեք դրանք Bluetooth-ի միջոցով և սեղմեք OK:\n    * USB Tethering. Եթե երկու հեռախոսներն էլ iPhone-ներ են, կամ երկուսն էլ՝ Android, նրանք կարող են համօգտագործել ինտերնետ հասանելիությունը USB մալուխի միջոցով, եթե ունեք ճիշտ մալուխ: Այսօր հեռախոսների մեծ մասն օգտագործում է USB-C միակցիչ, սակայն iPhone 14-ը և ավելի վաղ օգտագործում են Lightning միակցիչ: Միացրեք հեռախոսները համապատասխան մալուխի միջոցով և սեղմեք OK:\n\n6. ՉԿԱ ԻՆՏԵՐՆԵՏ. Եթե այս տարբերակներից ոչ մեկը հասանելի չէ, նախ սեղմեք OK, ապա «Բոլոր միացման փորձերը ձախողվեցին»:",
    bg: "ТЕСТОВИЯТ ТЕЛЕФОН СВЪРЗАН ЛИ Е КЪМ ИНТЕРНЕТ?\n1. ДА, след това щракнете върху OK по-долу, за да продължите.\n2. 📶 КЛЕТЪЧНА УСЛУГА: Ако клетъчната услуга на телефона се свърже с интернет, щракнете върху OK.\n3. 🛜 WIFI: Свържете го с интернет чрез Wi-Fi и щракнете върху OK.\n4. ЗАДАВАНЕ НА ЧАС И ДАТА: Нов телефон или стар телефон, който е нулиран, няма акаунт за клетъчна услуга и грешна дата. След като зададете часа и датата, ще работи с гореща точка/тетъринг, както е обяснено по-нататък.\n5. ГОРЕЩА ТОЧКА: Ако тестовият телефон не е вашият личен телефон и личният ви телефон има интернет, двата телефона могат да споделят достъп до интернет. Свържете телефоните един към друг чрез Wi-Fi, Bluetooth или USB:\n    * 🛜 Wi-Fi гореща точка: Ако вашият личен телефон е свързан към интернет чрез клетъчна услуга, той може да предостави Wi-Fi гореща точка на тестовия телефон. След като се свържете, щракнете върху OK.\n    * >ᛒ Bluetooth тетъринг: Ако личният ви телефон използва Wi-Fi за достъп до интернет, той може да споделя достъпа до интернет чрез Bluetooth. Активирайте Bluetooth (на iPhone) или Bluetooth тетъринг (на Android) и на двата телефона, сдвоете ги чрез Bluetooth и щракнете върху OK.\n    * USB тетъринг: Ако и двата телефона са iPhone или и двата телефона са Android, те могат да споделят интернет достъпа чрез USB кабел, ако имате правилния кабел. Днес повечето телефони използват USB-C конектор, но iPhone 14 и по-ранните модели използват Lightning конектора. Свържете телефоните чрез съответния кабел и щракнете върху OK.\n\n6. НЯМА ИНТЕРНЕТ: Ако нито една от тези опции не е налична, първо щракнете върху OK и след това върху „Всички опити за свързване са неуспешни“.",
