    hu: "A TESZTTELEFON CSATLAKOZTATVA AZ INTERNETRE?\n1. IGEN, majd kattintson az OK gombra lentebb a folytatáshoz.\n2. 📶 CELL SZOLGÁLTATÁS: Ha a telefon mobilszolgáltatása csatlakozik az internethez, kattintson az OK gombra.\n3. 🛜 WIFI: Csatlakoztassa az internethez Wi-Fi-n keresztül, és kattintson az OK gombra.\n4. IDŐ ÉS DÁTUM BEÁLLÍTÁSA: Egy új vagy egy visszaállított régi telefonnak nincs mobilszolgáltatási fiókja, és rossz a dátum. Miután beállította az időt és a dátumot, a hotspottal/internetmegosztással fog működni, amint azt a következőkben ismertetjük.\n5. HOTSPOT: Ha a teszttelefon nem az Ön személyes telefonja, és a személyes telefonja rendelkezik internettel, a két telefon megoszthatja az internet-hozzáférést. Csatlakoztassa a telefonokat egymáshoz Wi-Fi-n, Bluetooth-on vagy USB-n keresztül:\n    * 🛜 Wi-Fi Hotspot: Ha személyes telefonja mobilszolgáltatáson keresztül csatlakozik az internethez, Wi-Fi hotspotot biztosíthat a teszttelefonnak. A csatlakozás után kattintson az OK gombra.\n    * >ᛒ Bluetooth-internetmegosztás: Ha személyes telefonja Wi-Fi-t használ az internet-hozzáféréshez, meg tudja osztani az internet-hozzáférést Bluetooth-on keresztül. Mindkét telefonon engedélyezze a Bluetooth-t (iPhone-on) vagy a Bluetooth-megosztást (Androidon), párosítsa őket Bluetooth-on keresztül, majd kattintson az OK gombra.\n    * USB-internetmegosztás: Ha mindkét telefon iPhone, vagy mindkét telefon Android, megoszthatják az internet-hozzáférést USB-kábelen keresztül, ha rendelkezik megfelelő kábellel. Manapság a legtöbb telefon USB-C csatlakozót használ, de az iPhone 14 és korábbi modellek a Lightning csatlakozót. Csatlakoztassa a telefonokat a megfelelő kábellel, majd kattintson az OK gombra.\n\n6. NINCS INTERNET: Ha ezen opciók egyike sem elérhető, először kattintson az OK gombra, majd az „Minden csatlakozási kísérlet sikertelen” gombra.",
    is: "Loading...",
    id: "APAKAH TELEPON UJI TERHUBUNG KE INTERNET?\n1. YA, lalu klik OK di bawah untuk melanjutkan.\n2. 📶 LAYANAN SELULER: Jika layanan seluler telepon terhubung ke internet, klik OK.\n3. 🛜 WIFI: Hubungkan ke internet melalui Wi-Fi dan klik OK.\n4. SET WAKTU DAN TANGGAL: Telepon baru, atau telepon lama yang telah disetel ulang, tidak memiliki akun layanan seluler dan tanggalnya salah. Setelah Anda mengatur waktu dan tanggal, telepon akan berfungsi dengan hotspot/tethering, seperti yang dijelaskan selanjutnya.\n5. HOTSPOT: Jika telepon uji bukan telepon pribadi Anda, dan telepon pribadi Anda memiliki internet, kedua telepon dapat berbagi akses internet. Hubungkan telepon satu sama lain melalui Wi-Fi, Bluetooth, atau USB:\n* 🛜 Hotspot Wi-Fi: Jika telepon pribadi Anda terhubung ke internet melalui layanan seluler, telepon tersebut dapat menyediakan hotspot Wi-Fi ke telepon uji. Setelah terhubung, klik OK.\n* >ᛒ Bluetooth Tethering: Jika ponsel pribadi Anda menggunakan Wi-Fi untuk akses internet, ponsel dapat berbagi akses internet melalui Bluetooth. Aktifkan Bluetooth (pada iPhone) atau Bluetooth tethering (pada Android) pada kedua ponsel, pasangkan melalui Bluetooth, dan klik OK.\n* USB Tethering: Jika kedua ponsel adalah iPhone atau kedua ponsel adalah Android, keduanya dapat berbagi akses internet melalui kabel USB, jika Anda memiliki kabel yang tepat. Saat ini, sebagian besar ponsel menggunakan konektor USB-C, tetapi iPhone 14 dan versi sebelumnya menggunakan konektor Lightning. Hubungkan ponsel melalui kabel yang sesuai dan klik OK.\n\n6. NO INTERNET: Jika tidak ada opsi ini yang tersedia, klik OK terlebih dahulu, lalu “All connection tries failed”.",
    it: "Loading...",
    ja: "テスト用のスマートフォンはインターネットに接続されていますか？\n1. はいの場合は、下の「OK」をクリックして続行してください。\n2. 📶 携帯電話サービス：スマートフォンの携帯電話サービスがインターネットに接続している場合は、「OK」をクリックしてください。\n3. 🛜 Wi-Fi：Wi-Fi経由でインターネットに接続し、「OK」をクリックしてください。\n4. 時刻と日付の設定：新しいスマートフォン、またはリセットされた古いスマートフォンには、携帯電話サービスのアカウントがなく、日付も間違っています。時刻と日付を設定すると、次に説明するホットスポット/テザリングが使用できるようになります。\n5. ホットスポット：テスト用のスマートフォンが個人用のスマートフォンではなく、個人用のスマートフォンにインターネット接続がある場合、2台のスマートフォンでインターネットアクセスを共有できます。 Wi-Fi、Bluetooth、またはUSBでスマートフォン同士を接続します。\n* 🛜 Wi-Fiホットスポット：個人用のスマートフォンが携帯電話サービス経由でインターネットに接続されている場合、テスト用のスマートフォンにWi-Fiホットスポットを提供できます。接続したら、「OK」をクリックします。\n* >ᛒ Bluetoothテザリング：個人用のスマートフォンがWi-Fiを使用してインターネットにアクセスしている場合、Bluetooth経由でインターネットアクセスを共有できます。両方のスマートフォンでBluetooth（iPhoneの場合）またはBluetoothテザリング（Androidの場合）を有効にし、Bluetooth経由でペアリングして、「OK」をクリックします。\n* USBテザリング：両方のスマートフォンがiPhoneの場合、または両方のスマートフォンがAndroidの場合、適切なケーブルがあればUSBケーブル経由でインターネットアクセスを共有できます。現在、ほとんどのスマートフォンはUSB-Cコネクタを使用していますが、iPhone 14以前のスマートフォンはLightningコネクタを使用しています。適切なケーブルでスマートフォンを接続し、「OK」をクリックします。\n\n6. インターネットに接続できない場合：これらのオプションがいずれも利用できない場合は、まず「OK」をクリックし、「すべての接続試行に失敗しました」をクリックします。",
