    fi: "Ok. Voit suorittaa tämän tutkimuksen ilman puhelinta. Seuraava tutkimuksemme kuitenkin käyttää puhelinta kaiuttimen kalibrointiin, mikä vaatii yhteyden. Haluamme toivottaa mahdollisimman monta osallistujaa tulevaan tutkimukseen. Voitko auttaa meitä ymmärtämään huolesi?",
    fr: "D'accord. Vous pouvez réaliser cette étude sans connecter votre téléphone. Cependant, notre prochaine étude utilisera le téléphone pour calibrer le haut-parleur, ce qui nécessite une connexion. Nous aimerions accueillir le plus grand nombre de participants possible pour cette future étude. Pouvez-vous nous aider à comprendre votre préoccupation ?",
