    el: "Loading...",
    he: "3. הגדר את המיקרופון. \n א. פרש את שלושת רגלי החצובה עד הסוף. \n ב. תפס המיקרופון של החצובה נמצא על מסתובב. סובב את הקליפ עד הצד לאיזה צד שמגביר את הקצה הגבוה ביותר של הקליפ. \n ג. הכנס את המיקרופון לקליפס החצובה, מלמטה, עד שהקצה התחתון של המיקרופון ישתלב עם הקצה הנמוך ביותר של הקליפ. \n ד. כוונן את ההטיה כדי להפוך את המיקרופון לאנכי, מצביע עד לתקרה. \n ה. הנח את החצובה על השולחן בינך לבין המחשב שלך. סובב את החצובה כדי להביא את המיקרופון לצדך. \n ו. דחוף את החצובה לכיוון המחשב שלך (או כל מה שיש בו את הרמקולים) עד ששתי הרגליים הרחוקות של החצובה כמעט נוגעות בה, והרגל השלישית קרובה אליך.\n4. לחצן המשך יופיע למטה. לחץ עליו כדי להתחיל בכיול.",
    hi: "3. माइक्रोफ़ोन सेट करें। \n  a. तीनों ट्राइपॉड पैरों को जितना हो सके उतना फैलाएँ। \n  b. ट्राइपॉड का माइक्रोफ़ोन क्लिप घूमने वाला है। क्लिप को उस तरफ़ घुमाएँ जहाँ से क्लिप का सबसे ऊँचा किनारा ऊपर हो। \n  c. माइक्रोफ़ोन को ट्राइपॉड क्लिप में नीचे से डालें, जब तक कि माइक्रोफ़ोन का निचला सिरा क्लिप के सबसे निचले किनारे से समतल न हो जाए। \n  d. माइक्रोफ़ोन को छत की ओर इंगित करते हुए लंबवत बनाने के लिए झुकाव को समायोजित करें। \n  e. ट्राइपॉड को अपने और अपने कंप्यूटर के बीच टेबल पर रखें। माइक्रोफ़ोन को अपनी तरफ़ लाने के लिए ट्राइपॉड को घुमाएँ। \n  f. ट्राइपॉड को अपने कंप्यूटर (या जहाँ भी स्पीकर हैं) की ओर तब तक धकेलें जब तक कि ट्राइपॉड के दूर के दो पैर लगभग उसे छू न लें, और तीसरा पैर आपके पास न आ जाए। \n\n4. नीचे एक आगे बढ़ें बटन दिखाई देगा। कैलिब्रेट करना शुरू करने के लिए इसे क्लिक करें।",
