    hy: "✅ Կատարված է։ Երկու անգամ չափված՝ ֆոնային ձայնի մակարդակը սկզբում եղել է 111, իսկ հետո՝ 222 դԲ SPL:  \n1. Չափումը կրկնելու համար, երբ պատրաստ լինի, կրկին սեղմեք RECORD:\n2. Հակառակ դեպքում պարզապես սեղմեք ՇԱՐՈՒՆԱԿԵԼ կամ սեղմեք RETURN:",
