    ja: "1. ⇧🔊 最大音量。正確なサウンドキャリブレーションを行うには、キャリブレーション前にコンピューターの音量を最大にし、セッションが終了するまで音量を調整しないでください。\n2. ヘッドフォンの使用禁止。ヘッドフォン/イヤホンを取り外してください。このキャリブレーションはヘッドフォン/イヤホンでは機能しません。",
    kn: "1. ⇧🔊 ಗರಿಷ್ಠ ಸಂಪುಟ. ನಿಖರವಾದ ಧ್ವನಿ ಮಾಪನಾಂಕ ನಿರ್ಣಯಕ್ಕಾಗಿ, ದಯವಿಟ್ಟು ಮಾಪನಾಂಕ ನಿರ್ಣಯದ ಮೊದಲು ಈಗ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನ ಧ್ವನಿಯ ಪರಿಮಾಣವನ್ನು ಗರಿಷ್ಠಗೊಳಿಸಿ ಮತ್ತು ನಂತರ ಸೆಶನ್ ಮುಗಿಯುವವರೆಗೆ ವಾಲ್ಯೂಮ್ ಅನ್ನು ಸ್ಪರ್ಶಿಸಬೇಡಿ.\n2. ಯಾವುದೇ ಹೆಡ್‌ಫೋನ್‌ಗಳಿಲ್ಲ. ಯಾವುದೇ ಹೆಡ್‌ಫೋನ್‌ಗಳು/ಇಯರ್‌ಬಡ್‌ಗಳನ್ನು ತೆಗೆದುಹಾಕಿ ಮತ್ತು ಸಂಪರ್ಕ ಕಡಿತಗೊಳಿಸಿ. ಈ ಮಾಪನಾಂಕ ನಿರ್ಣಯವು ಹೆಡ್‌ಫೋನ್‌ಗಳು/ಇಯರ್‌ಬಡ್‌ಗಳೊಂದಿಗೆ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದಿಲ್ಲ.",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "1. ⇧🔊 പരമാവധി വോളിയം. കൃത്യമായ ശബ്‌ദ കാലിബ്രേഷനായി, കാലിബ്രേഷന് മുമ്പ്, നിങ്ങളുടെ കമ്പ്യൂട്ടറിൻ്റെ ശബ്‌ദ വോളിയം ഇപ്പോൾ പരമാവധി വർദ്ധിപ്പിക്കുക, തുടർന്ന് സെഷൻ അവസാനിക്കുന്നത് വരെ വോളിയത്തിൽ തൊടരുത്.\n2. ഹെഡ്ഫോണുകൾ ഇല്ല. ഏതെങ്കിലും ഹെഡ്‌ഫോണുകൾ/ഇയർബഡുകൾ നീക്കം ചെയ്‌ത് വിച്ഛേദിക്കുക. ഹെഡ്‌ഫോണുകൾ/ഇയർബഡുകൾ എന്നിവയിൽ ഈ കാലിബ്രേഷൻ പ്രവർത്തിക്കില്ല.",
    no: "1. ⇧🔊 MAKS VOLUM. For nøyaktig lydkalibrering må du maksimere datamaskinens lydvolum nå, før kalibrering, og deretter ikke berøre volumet før økten er over.\n2. INGEN HODETELEFON. Fjern og koble fra eventuelle hodetelefoner/øreplugger. Denne kalibreringen fungerer ikke med hodetelefoner/øreplugger.",
    fa: "Loading...",
    pl: "1. ⇧🔊 MAKSYMALNA GŁOŚNOŚĆ. Aby uzyskać dokładną kalibrację dźwięku, zmaksymalizuj głośność dźwięku komputera teraz, przed kalibracją, a następnie nie zmieniaj głośności do zakończenia sesji.\n2. BRAK SŁUCHAWEK. Zdejmij i odłącz wszystkie słuchawki/wkładki douszne. Ta kalibracja nie będzie działać ze słuchawkami/wkładkami dousznymi.",
    pt: "1. ⇧🔊 VOLUME MÁXIMO. Para uma calibração de som precisa, aumente o volume do seu computador agora, antes da calibração, e não toque no volume até o término da sessão.\n2. SEM FONES DE OUVIDO. Remova e desconecte quaisquer fones de ouvido. Esta calibração não funciona com fones de ouvido.",
