    ru: "1. ⇧🔊 МАКСИМАЛЬНАЯ ГРОМКОСТЬ. Для точной калибровки звука, пожалуйста, увеличьте громкость звука вашего компьютера сейчас, перед калибровкой, и не трогайте громкость до окончания сеанса. \n2. БЕЗ НАУШНИКОВ. Снимите и отсоедините все наушники/вкладыши. Эта калибровка не будет работать с наушниками/вкладышами.",
    sr: "1. ⇧🔊 МАКСИМАЛНИ ВОЛУМЕ. За тачну калибрацију звука, повећајте јачину звука на рачунару сада, пре калибрације, а затим не додирујте јачину звука док се сесија не заврши.\n2. НЕМА СЛУШАЛИЦА. Уклоните и искључите све слушалице/бублице. Ова калибрација неће радити са слушалицама/бубицама.",
