    bg: "1. ⇧🔊 МАКСИМАЛЕН ОБЕМ. За точен звук, моля, увеличете максимално силата на звука на компютъра си сега и след това не докосвайте силата на звука, докато сесията не приключи.\n2. БЕЗ СЛУШАЛКИ. Отстранете и разкачете всички слушалки/тапи, защото биха направили звука неточен.",
    "zh-CN":
      "1. ⇧🔊 最大音量。为了获得准确的音质，请立即将电脑音量调到最大，并且在会话结束前请勿再调整音量。\n2. 禁止佩戴耳机。请摘下并断开所有耳机/耳塞，因为它们会影响音质。",
    "zh-HK": "Loading...",
    hr: "1. ⇧🔊 MAKSIMALNI VOLUME. Za točan zvuk, maksimalno povećajte glasnoću zvuka vašeg računala sada, a zatim ne dirajte glasnoću dok sesija ne završi.\n2. BEZ SLUŠALICA. Uklonite i odspojite sve slušalice/bubice jer bi zvuk bio netočan.",
    cs: "Loading...",
    da: "1. ⇧🔊 MAKS. LYDSTYRKE. For nøjagtig lyd skal du maksimere din computers lydstyrke nu og derefter ikke røre ved lydstyrken, før sessionen slutter.\n2. INGEN HOVEDTELEFONER. Fjern og frakobl eventuelle hovedtelefoner/øretelefoner, da de ville gøre lyden unøjagtig.",
    nl: "Loading...",
    "en-UK":
      "1. ⇧🔊 MAX VOLUME. For accurate sound, please maximize your computer's sound volume now, and then don't touch the volume until the session ends.\n2. NO HEADPHONES. Remove and disconnect any headphones/earbuds, because they would make the sound inaccurate.",
    fi: "1. ⇧🔊 MAX VOLUME. Tarkka äänen saamiseksi maksimoi tietokoneesi äänenvoimakkuus nyt ja älä kosketa äänenvoimakkuutta ennen kuin istunto on päättynyt.\n2. EI KUULOKKEITA. Irrota ja irrota kuulokkeet/nappikuulokkeet, koska ne tekisivät äänestä epätarkan.",
