    de: "1. ⇧🔊 MAXIMALE LAUTSTÄRKE. Für einen präzisen Klang stellst du die Lautstärke deines Computers jetzt auf das Maximum und berührst sie danach nicht mehr, bis die Sitzung beendet ist.\n2. KEINE KOPFHÖRER. Entferne alle Kopfhörer/Ohrhörer, da diese den Klang verfälschen.",
    el: "1. ⇧🔊 MAX VOLUME. Για ακριβή ήχο, μεγιστοποιήστε την ένταση ήχου του υπολογιστή σας τώρα και, στη συνέχεια, μην αγγίζετε την ένταση μέχρι να τελειώσει η περίοδος λειτουργίας.\n2. ΟΧΙ ΑΚΟΥΣΤΙΚΑ. Αφαιρέστε και αποσυνδέστε τυχόν ακουστικά/ ακουστικά, γιατί θα έκαναν τον ήχο ανακριβή.",
    he: "Loading...",
    hi: "Loading...",
