    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "1. ⇧🔊 MAKSYMALNA GŁOŚNOŚĆ. Aby uzyskać dokładny dźwięk, zmaksymalizuj teraz głośność dźwięku komputera, a następnie nie zmieniaj głośności do zakończenia sesji.\n2. BRAK SŁUCHAWEK. Zdejmij i odłącz słuchawki/wkładki douszne, ponieważ mogą one powodować niedokładność dźwięku.",
    pt: "Loading...",
