    ru: "1. ⇧🔊 МАКСИМАЛЬНАЯ ГРОМКОСТЬ. Для точного звука, пожалуйста, увеличьте громкость звука вашего компьютера сейчас, а затем не трогайте громкость до окончания сеанса.\n2. БЕЗ НАУШНИКОВ. Снимите и отсоедините все наушники/вкладыши, так как они сделают звук неточным.",
    sr: "1. ⇧🔊 МАКСИМАЛНИ ВОЛУМЕ. За прецизан звук, повећајте јачину звука на рачунару сада, а затим не додирујте јачину звука док се сесија не заврши.\n2. НЕМА СЛУШАЛИЦА. Уклоните и ископчајте све слушалице/ушице, јер би оне учиниле звук нетачним.",
