    tl: "Loading...",
    tr: "1. ⇧🔊 MAKSİMUM SES. Doğru ses için lütfen bilgisayarınızın ses seviyesini şimdi en üst düzeye çıkarın ve ardından oturum bitene kadar sese dokunmayın.\n2. KULAKLIK YOK. Kulaklıkları/kulak içi kulaklıkları çıkarın ve bağlantısını kesin, çünkü sesi yanlış yaparlar.",
    ur: "1. ⇧🔊 زیادہ سے زیادہ حجم۔ درست آواز کے لیے، براہ کرم اپنے کمپیوٹر کی آواز والیوم کو ابھی زیادہ سے زیادہ کریں، اور پھر سیشن ختم ہونے تک والیوم کو مت چھویں۔\n2. کوئی ہیڈ فون نہیں۔ کسی بھی ہیڈ فون/ایئربڈ کو ہٹا دیں اور منقطع کریں، کیونکہ وہ آواز کو غلط بنا دیں گے۔",
