    kn: "ನಿಮ್ಮ ಧ್ವನಿವರ್ಧಕಗಳನ್ನು ಮಾಪನಾಂಕ ನಿರ್ಣಯಿಸಲು, ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಯಲ್ಲಿ ಮೈಕ್ರೋಫೋನ್ ಇರುವ ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ನಿಮಗೆ ಬೇಕಾಗುತ್ತದೆ. ಆಶಾದಾಯಕವಾಗಿ ನಿಮ್ಮದು. ಲೈಬ್ರರಿಯಲ್ಲಿರುವ ಒಂದನ್ನು ಹುಡುಕಲು ನೀವು ಒಂದರ ನಂತರ ಒಂದರಂತೆ ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಪ್ರಯತ್ನಿಸಬಹುದು. \n",
    ko: "라우드 스피커를 보정하려면 프로필 라이브러리에 마이크가 있는 스마트폰이 필요합니다. 혹시 당신의 스마트폰이 그럴 수도 있습니다. 라이브러리에 있는 스마트폰을 찾으려면 여러 스마트폰을 시도해 보세요.\n",
    lt: "Norėdami sukalibruoti garsiakalbius, jums reikia išmaniojo telefono, kurio mikrofonas yra profilių bibliotekoje. Tikimės, kad tavo. Galite išbandyti vieną išmanųjį telefoną po kito, kad rastumėte vieną, esantį bibliotekoje. \n",
    ms: "Untuk menentukur pembesar suara anda, anda memerlukan telefon pintar yang mikrofonnya berada dalam pustaka profil. Semoga milik anda. Anda boleh mencuba satu demi satu telefon pintar untuk mencari telefon pintar yang ada dalam perpustakaan. \n",
    ml: "നിങ്ങളുടെ ലൗഡ്‌സ്പീക്കറുകൾ കാലിബ്രേറ്റ് ചെയ്യാൻ പ്രൊഫൈൽ ലൈബ്രറിയിൽ മൈക്രോഫോൺ ഉള്ള ഒരു സ്‌മാർട്ട്‌ഫോൺ ആവശ്യമാണ്. നിങ്ങളുടേത് ആയിരിക്കുമെന്ന് പ്രതീക്ഷിക്കുന്നു. ലൈബ്രറിയിൽ ഉള്ളത് കണ്ടെത്താൻ നിങ്ങൾക്ക് ഒന്നിന് പുറകെ ഒന്നായി സ്‌മാർട്ട്‌ഫോൺ പരീക്ഷിക്കാം. \n",
    no: "For å kalibrere høyttalerne trenger du en smarttelefon hvis mikrofon er i profilbiblioteket. Forhåpentligvis er din det. Du kan prøve den ene smarttelefonen etter den andre for å finne en som er i biblioteket. \n",
    fa: "برای کالیبره کردن بلندگوهای خود به گوشی هوشمندی نیاز دارید که میکروفون آن در کتابخانه پروفایل باشد. امیدوارم مال شما باشه می‌توانید گوشی‌های هوشمند را یکی پس از دیگری امتحان کنید تا گوشی موجود در کتابخانه را پیدا کنید. \n",
    pl: "Loading...",
    pt: "Para calibrar seus alto-falantes, você precisa de um smartphone cujo microfone esteja na biblioteca de perfis. Espero que o seu esteja. Você pode testar vários smartphones para encontrar um que esteja na biblioteca.\n",
