    pt: 'ESCOLHA COMO CALIBRAR SEUS ALTO-FALANTES:\n1. JÁ PRONTO. Se você já calibrou os alto-falantes deste computador, pode ter a opção de pular a recalibração reutilizando seu perfil de calibração existente. Caso contrário, selecione um microfone para calibrar. Observação: as regras de segurança do aplicativo web limitam a capacidade de reconhecimento do computador, portanto, um computador já calibrado pode não ser reconhecido. Se isso acontecer, basta recalibrar. Ele provavelmente será reconhecido na próxima vez.\n2. SMARTPHONE. Use o microfone integrado do seu smartphone.\n3. USB. Se você possui um microfone miniDSP UMIK-1 ou UMIK-2 (disponível na Amazon), selecione "USB" e conecte seu microfone a este computador.',
    ro: "Loading...",
    ru: "ВЫБЕРИТЕ СПОСОБ КАЛИБРОВКИ ДИНАМИКОВ:\n1. УЖЕ СДЕЛАНО. Если вы ранее калибровали динамики этого компьютера, у вас может быть возможность пропустить повторную калибровку, повторно используя существующий профиль калибровки. В противном случае выберите микрофон для калибровки. Примечание: правила безопасности веб-приложений ограничивают распознаваемость компьютера, поэтому уже откалиброванный компьютер может остаться нераспознанным. Если это произойдет, просто выполните повторную калибровку. Вероятно, он будет распознан в следующий раз.\n2. СМАРТФОН. Используйте встроенный микрофон вашего смартфона.\n3. USB. Если у вас есть микрофон miniDSP UMIK-1 или UMIK-2 (доступный на Amazon), выберите «USB» и подключите микрофон к этому компьютеру.",
    sr: "Loading...",
    es: 'ELIGE CÓMO CALIBRAR TUS ALTAVOCES:\n1. YA ESTÁ LISTO. Si ya calibraste los altavoces de este ordenador, puedes omitir la recalibración reutilizando tu perfil de calibración. De lo contrario, selecciona un micrófono para calibrar. Nota: Las reglas de seguridad de la aplicación web limitan la capacidad de reconocimiento del ordenador, por lo que un ordenador ya calibrado podría no ser reconocido. Si esto ocurre, simplemente recalibra. Probablemente sí lo sea la próxima vez.\n2. TELÉFONO INTELIGENTE. Usa el micrófono integrado de tu smartphone.\n3. USB. Si tienes un micrófono miniDSP UMIK-1 o UMIK-2 (disponible en Amazon), selecciona "USB" y conecta el micrófono a este ordenador.',
    sw: 'CHAGUA JINSI YA KUHARIBU WASEMAJI WAKO:\n1. TAYARI IMEKWISHA. Ikiwa hapo awali ulirekebisha vipaza sauti vya kompyuta hii, unaweza kuwa na chaguo la kuruka urekebishaji upya kwa kutumia tena wasifu wako uliopo wa urekebishaji. Vinginevyo, chagua maikrofoni ili kusawazisha. Kumbuka: Sheria za usalama za programu ya wavuti hupunguza utambuzi wa kompyuta, kwa hivyo kompyuta iliyosawazishwa tayari inaweza kutotambuliwa. Ikiwa hii itatokea, rekebisha tu. Pengine itatambuliwa wakati ujao.\n2. SMARTPHONE. Tumia maikrofoni iliyojengewa ndani ya simu yako mahiri.\n3. USB. Ikiwa unamiliki maikrofoni ya miniDSP UMIK-1 au UMIK-2 (inapatikana kwenye Amazon), chagua "USB" na uunganishe maikrofoni yako kwenye kompyuta hii.',
    sv: "Loading...",
    tl: "Loading...",
    tr: 'HOPARLÖRLERİNİZİ NASIL KALİBRE EDECEĞİNİZİ SEÇİN:\n1. ZATEN YAPILDI. Bu bilgisayarın hoparlörlerini daha önce kalibre ettiyseniz, mevcut kalibrasyon profilinizi yeniden kullanarak yeniden kalibrasyonu atlama seçeneğiniz olabilir. Aksi takdirde, kalibre etmek için bir mikrofon seçin. Not: Web uygulaması güvenlik kuralları bilgisayar tarafından tanınabilirliği sınırlar, bu nedenle önceden kalibre edilmiş bir bilgisayar tanınmayabilir. Bu olursa, basitçe yeniden kalibre edin. Muhtemelen bir dahaki sefere tanınacaktır.\n2. AKILLI TELEFON. Akıllı telefonunuzun dahili mikrofonunu kullanın.\n3. USB. Bir miniDSP UMIK-1 veya UMIK-2 mikrofonunuz varsa (Amazon\'da mevcuttur), "USB"yi seçin ve mikrofonunuzu bu bilgisayara bağlayın.',
    ur: "Loading...",
