    fa: "❌ متأسفیم، آخرین اندازه‌گیری‌های چپ و راست ناسازگار بودند. دوباره امتحان کنید؟ یک چشم خود را بسته نگه دارید. روی صلیب تمرکز کنید و نقطه چشمک زن را از گوشه چشم خود نظارت کنید. نقطه را به چپ و راست بلغزانید تا در نقطه کور ناپدید شود و سپس نوار SPACE را بزنید. هنگام تست هر دو چشم فاصله دید خود را حفظ کنید.",
    pl: "❌ Przepraszamy, ostatnie pomiary lewej i prawej strony były niespójne. Spróbuj ponownie? Zamknij jedno oko. Skup się na krzyżyku i obserwuj migający punkt kątem oka. Przesuwaj punkt w lewo i prawo, aż zniknie w martwym polu, a następnie naciśnij spację. Zachowaj odległość oglądania, testując oboje oczu.",
    pt: "❌ Desculpe, as medições mais recentes dos olhos esquerdo e direito estavam inconsistentes. Tentar novamente? Mantenha um olho fechado. Concentre-se na cruz e observe o ponto piscante no canto do olho. Deslize o ponto para a esquerda e para a direita até que ele desapareça no seu ponto cego e, em seguida, pressione a barra de ESPAÇO. Mantenha a distância de visão enquanto testa os dois olhos.",
    ro: "❌ Ne pare rău, cele mai recente măsurători din stânga și din dreapta au fost inconsecvente. Încearcă din nou? Țineți un ochi închis. Concentrați-vă pe cruce și monitorizați punctul intermitent cu coada ochiului. Glisați punctul la stânga și la dreapta până când dispare în punctul mort, apoi apăsați pe bara SPAȚIU. Mențineți distanța de vizualizare în timp ce testați ambii ochi.",
    ru: "❌ Извините, последние левые и правые измерения были несовместимы. Попробуйте еще раз? Держите один глаз закрытым. Сосредоточьтесь на кресте и следите за мигающей точкой краем глаза. Двигайте точку влево и вправо, пока она не исчезнет в слепой зоне, а затем нажмите клавишу ПРОБЕЛ. Сохраняйте расстояние между глазами, проверяя оба глаза.",
    sr: "❌ Жао нам је, последња лева и десна мерења нису била доследна. Покушајте поново? Држите једно око затворено. Усредсредите се на крст и надгледајте трепћућу тачку крајичком ока. Померајте тачку лево-десно док не нестане у вашој слепој тачки, а затим притисните РАЗМАКНИЦУ. Одржавајте удаљеност гледања док тестирате оба ока.",
    es: "❌ Lo sentimos, las últimas mediciones izquierda y derecha fueron inconsistentes. ¿Quieres volver a intentarlo? Mantén un ojo cerrado. Enfócate en la cruz y observa el punto parpadeante con el rabillo del ojo. Desliza el punto de izquierda a derecha hasta que desaparezca en tu punto ciego y luego pulsa la barra espaciadora. Mantén la distancia de visión mientras examinas ambos ojos.",
    sw: "❌ Samahani, vipimo vya hivi majuzi zaidi vya kushoto na kulia havikuwa sawa. Ungependa kujaribu tena? Weka jicho moja limefungwa. Zingatia msalaba na ufuatilie nukta inayong'aa kutoka kwenye kona ya jicho lako. Telezesha kitone kushoto na kulia hadi kipotee kwenye upofu wako, kisha ugonge upau wa SPACE. Dumisha umbali wako wa kutazama unapojaribu macho yote mawili.",
    sv: "❌ Tyvärr, de senaste vänster- och högermåtten var inkonsekventa. Försök igen? Håll ett öga stängt. Fokusera på korset och övervaka den blinkande punkten i ögonvrån. Skjut punkten åt vänster och höger tills den försvinner i din döda vinkel och tryck sedan på MELLANSLAG. Behåll ditt synavstånd när du testar båda ögonen.",
