    tl: "Upang makagawa ng tumpak na tunog, kailangang i-calibrate ng pag-aaral ang mga loudspeaker. Nangangailangan ito ng isang smartphone na nakakonekta sa internet. Mayroon ka bang isang madaling gamitin? \n",
    tr: "Doğru sesi üretmek için, çalışmanın hoparlörleri kalibre etmesi gerekiyor. Bunun için internete bağlı bir akıllı telefona ihtiyacınız var. Elinizde bir tane var mı?\n",
