    fa: "تغییر خط از بزرگ و آسان به کوچک و سخت متفاوت است. شما نمی توانید خیلی بیشتر از دو سوم درست دریافت کنید، پس آرام باشید. آن را به عنوان یک بازی حدس زدن در نظر بگیرید، و فقط تا جایی که می توانید تعداد زیادی را دریافت کنید. هر زمان که حق با شما باشد یک بوق می شنوید.",
    pl: "Przesunięcie linii waha się od dużego i łatwego do małego i trudnego. Nie możesz uzyskać więcej niż dwie trzecie poprawnej odpowiedzi, więc się zrelaksuj. Pomyśl o tym jak o grze w zgadywanie i po prostu uzyskaj tyle, ile możesz. Usłyszysz sygnał dźwiękowy, gdy tylko uzyskasz poprawną odpowiedź.",
    pt: "Loading...",
    ro: "Deplasarea liniei variază de la mare și ușor până la mic și greu. Nu poți să înțelegi mai mult de două treimi, așa că relaxează-te. Gândiți-vă la el ca la un joc de ghicituri și obțineți cât mai multe. Vei auzi un bip ori de câte ori ai dreptate.",
