    sr: "Померање линије варира од великог и лаког до малог и тешког. Не можете добити више од две трећине у праву, зато се опустите. Замислите то као игру погађања и само узмите што више можете. Чућете бип кад год сте у праву.",
    es: "Loading...",
    sw: "Mabadiliko ya mstari hutofautiana kutoka kubwa na rahisi chini hadi ndogo na ngumu. Huwezi kupata haki zaidi ya theluthi mbili, kwa hivyo pumzika. Ifikirie kama mchezo wa kubahatisha, na upate nyingi uwezavyo. Utasikia mlio wakati wowote ukiwa sahihi.",
    sv: "Linjeskiftet varierar från stort och lätt ner till litet och hårt. Du kan inte få mycket mer än två tredjedelar rätt, så slappna av. Se det som ett gissningsspel och få så många du kan. Du kommer att höra ett pip när du har rätt.",
