    ar: "Loading...",
    hy: "ՀԵՌԱՎՈՐՆԵՐՈՒՄ ԴՈՒՔ ԿՕԳՏԱԳՈՐԾԵՔ ՁԵՐ ՀԵՌԱԽՈՍԸ ՈՐՊԵՍ Ստեղնաշար: Միացրեք այն հիմա՝ ավելի ուշ օգտագործելու համար: Ուղղեք ձեր սմարթֆոնի տեսախցիկը այս QR կոդի վրա: Այնուհետև հպեք ձեր սմարթֆոնի էկրանին երևացող հղմանը:",
    bg: "НА ДАЛЕЧНИ РАЗСТОЯНИЯ ЩЕ ИЗПОЛЗВАТЕ ТЕЛЕФОНА СИ КАТО КЛАВИАТУРА. Свържете го сега за използване по-късно. Насочете камерата на вашия смартфон към този QR код. След това докоснете връзката, която се появява на екрана на вашия смартфон.",
    "zh-CN":
      "在远距离情况下，您将把手机用作键盘。现在连接，以便稍后使用。将智能手机摄像头对准此二维码。然后点击智能手机屏幕上显示的链接。",
