    hy: "Պատմության ժամանակ! Դուք կկարդաք գրքից 111 էջ: Երբ սկսեք, խնդրում ենք լուռ կարդացեք բոլոր էջերը որքան կարող եք արագ՝ պահպանելով ամբողջական ըմբռնումը, մինչև հասնեք ավարտին: Այնուհետև մենք ձեզ մի քանի հարց կտանք պատմության վերաբերյալ: Յուրաքանչյուր էջում սեղմեք SPACE սանդղակը հաջորդ էջի համար: Երբ պատրաստ լինեք, սեղմեք SPACE:",
    bg: "Време за приказки! Ще прочетете 111 страници от книга. След като започнете, моля, прочетете мълчаливо всички страници възможно най-бързо, като същевременно поддържате пълно разбиране, докато стигнете до края. След това ще ви зададем няколко въпроса за историята. На всяка страница натискайте ИНТЕРВАЛ за следващата страница. Когато сте готови, натиснете SPACE.",
