    "zh-HK":
      "故事時間到了！您將閱讀一本書的 111 頁。一旦開始，請盡快默讀所有頁面，同時保持完全理解，直到讀完。然後我們會問你幾個關於這個故事的問題。在每一頁上，按空白鍵可翻到下一頁。準備好後，按 SPACE 鍵。",
    hr: "Vrijeme za priče! Pročitat ćete 111 stranica iz knjige. Nakon što počnete, pročitajte u tišini sve stranice što brže možete, zadržavajući potpuno razumijevanje, dok ne dođete do kraja. Zatim ćemo vam postaviti nekoliko pitanja o priči. Na svakoj stranici pritisnite razmaknicu za sljedeću stranicu. Kada ste spremni, pritisnite RAZMAKNICU.",
    cs: "Čas na příběh! Z knihy přečtete 111 stran. Jakmile začnete, přečtěte si prosím potichu všechny stránky tak rychle, jak jen můžete, při zachování plného porozumění, dokud nedojdete na konec. Poté vám položíme několik otázek k příběhu. Na každé stránce stiskněte mezerník pro zobrazení další stránky. Až budete připraveni, stiskněte MEZERNÍK.",
    da: "Loading...",
    nl: "Tijd voor een verhaal! Je leest 111 pagina's uit een boek. Lees, zodra je begint, alle pagina's in stilte en zo snel mogelijk, terwijl je het verhaal volledig begrijpt, tot je het einde hebt bereikt. Daarna stellen we je een paar vragen over het verhaal. Druk op elke pagina op de spatiebalk om naar de volgende pagina te gaan. Als je klaar bent, druk je op de spatiebalk.",
    "en-UK":
      "Story time! You'll read 111 pages from a book. Once you start, please silently read all the pages as fast as you can, while maintaining full comprehension, until you reach the end. Then we'll ask you a few questions about the story. On each page, press the SPACE bar for the next page. When you're ready, press SPACE.",
    fi: "Loading...",
    fr: "Loading...",
    de: "Zeit für eine Geschichte! Du liest 111 Seiten aus einem Buch. Lies die Seiten bitte so schnell wie möglich still und ohne zu versäumen, bis du das Ende erreichst. Anschließend stellen wir dir ein paar Fragen zur Geschichte. Drücke auf jeder Seite die LEERTASTE, um zur nächsten Seite zu gelangen. Wenn du bereit bist, drücke die LEERTASTE.",
    el: "Loading...",
    he: "שעת סיפור! אתה תקרא 111 עמודים מתוך ספר. לאחר שתתחיל, אנא קרא בשקט את כל הדפים מהר ככל שאתה יכול, תוך שמירה על הבנה מלאה, עד שתגיע לסוף. לאחר מכן נשאל אותך כמה שאלות על הסיפור. בכל עמוד, לחץ על מקש הרווח עבור העמוד הבא. כשתהיה מוכן, הקש על רווח.",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Saatnya bercerita! Anda akan membaca 111 halaman dari sebuah buku. Setelah memulai, bacalah semua halaman secepat mungkin dalam hati, sambil tetap memahami sepenuhnya, hingga Anda mencapai akhir cerita. Kemudian kami akan mengajukan beberapa pertanyaan tentang cerita tersebut. Pada setiap halaman, tekan tombol SPACE untuk halaman berikutnya. Saat Anda siap, tekan SPACE.",
    it: "Loading...",
    ja: "ストーリータイム！111ページ分の本を読みます。読み始めたら、最後まで理解力を保ちながら、できるだけ早く黙読してください。その後、物語に関する質問をいくつかさせていただきます。各ページで、スペースキーを押すと次のページに進みます。準備ができたら、スペースキーを押します。",
    kn: "ಕಥೆಯ ಸಮಯ! ನೀವು ಪುಸ್ತಕದಿಂದ 111 ಪುಟಗಳನ್ನು ಓದುತ್ತೀರಿ. ಒಮ್ಮೆ ನೀವು ಪ್ರಾರಂಭಿಸಿದ ನಂತರ, ದಯವಿಟ್ಟು ಎಲ್ಲಾ ಪುಟಗಳನ್ನು ನೀವು ಸಾಧ್ಯವಾದಷ್ಟು ವೇಗವಾಗಿ ಓದಿ, ಪೂರ್ಣ ಗ್ರಹಿಕೆಯನ್ನು ಕಾಪಾಡಿಕೊಳ್ಳುವಾಗ, ನೀವು ಅಂತ್ಯವನ್ನು ತಲುಪುವವರೆಗೆ. ನಂತರ ನಾವು ನಿಮಗೆ ಕಥೆಯ ಬಗ್ಗೆ ಕೆಲವು ಪ್ರಶ್ನೆಗಳನ್ನು ಕೇಳುತ್ತೇವೆ. ಪ್ರತಿ ಪುಟದಲ್ಲಿ, ಮುಂದಿನ ಪುಟಕ್ಕಾಗಿ SPACE ಬಾರ್ ಅನ್ನು ಒತ್ತಿರಿ. ನೀವು ಸಿದ್ಧರಾದಾಗ, SPACE ಒತ್ತಿರಿ.",
    ko: "이야기 시간입니다! 책 한 권을 111페이지까지 읽어주세요. 시작하면 모든 페이지를 최대한 빨리, 그리고 완전히 이해한 상태로 조용히 끝까지 읽어주세요. 그런 다음 이야기에 대한 몇 가지 질문을 드리겠습니다. 각 페이지에서 스페이스바를 눌러 다음 페이지로 넘어가세요. 준비가 되면 스페이스바를 누르세요.",
    lt: "Loading...",
    ms: "masa cerita! Anda akan membaca 111 muka surat daripada sebuah buku. Sebaik sahaja anda mula, sila baca senyap semua halaman secepat yang anda boleh, sambil mengekalkan pemahaman penuh, sehingga anda sampai ke penghujung. Kemudian kami akan bertanya kepada anda beberapa soalan tentang cerita itu. Pada setiap halaman, tekan bar SPACE untuk halaman seterusnya. Apabila anda sudah bersedia, tekan SPACE.",
    ml: "കഥാ സമയം! ഒരു പുസ്തകത്തിൽ നിന്ന് 111 പേജുകൾ നിങ്ങൾ വായിക്കും. നിങ്ങൾ ആരംഭിച്ചുകഴിഞ്ഞാൽ, അവസാനം എത്തുന്നതുവരെ, പൂർണ്ണമായ ഗ്രാഹ്യം നിലനിർത്തിക്കൊണ്ട്, കഴിയുന്നത്ര വേഗത്തിൽ എല്ലാ പേജുകളും നിശബ്ദമായി വായിക്കുക. അപ്പോൾ ഞങ്ങൾ നിങ്ങളോട് കഥയെക്കുറിച്ച് കുറച്ച് ചോദ്യങ്ങൾ ചോദിക്കും. ഓരോ പേജിലും, അടുത്ത പേജിനായി SPACE ബാർ അമർത്തുക. നിങ്ങൾ തയ്യാറാകുമ്പോൾ, SPACE അമർത്തുക.",
    no: "Historietid! Du vil lese 111 sider fra en bok. Når du har startet, vennligst les alle sidene stille så raskt du kan, mens du opprettholder full forståelse, til du kommer til slutten. Så stiller vi deg noen spørsmål om historien. På hver side trykker du på MELLOMROM for neste side. Når du er klar, trykk MELLOMROM.",
    fa: "زمان داستان! شما 111 صفحه از یک کتاب را خواهید خواند. هنگامی که شروع کردید، لطفاً تمام صفحات را تا جایی که می توانید در سکوت کامل بخوانید و در عین حال درک کامل را حفظ کنید تا به پایان برسید. سپس چند سوال در مورد داستان از شما خواهیم پرسید. در هر صفحه، نوار SPACE را برای صفحه بعدی فشار دهید. وقتی آماده شدید، SPACE را فشار دهید.",
    pl: "Loading...",
    pt: "Hora da história! Você lerá 111 páginas de um livro. Ao começar, leia todas as páginas em silêncio, o mais rápido possível, mantendo a compreensão completa, até chegar ao final. Em seguida, faremos algumas perguntas sobre a história. Em cada página, pressione a barra de espaço para a próxima página. Quando estiver pronto, pressione a barra de espaço.",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Време за причу! Прочитаћете 111 страница из књиге. Када почнете, молимо вас да у тишини прочитате све странице што је брже могуће, уз потпуно разумевање, док не дођете до краја. Затим ћемо вам поставити неколико питања о причи. На свакој страници притисните размакницу за следећу страницу. Када будете спремни, притисните СПАЦЕ.",
