    ur: 'آواز کا پتہ لگانا\n\nآپ کئی آزمائشیں مکمل کریں گے۔ ہر آزمائش میں، آپ کو ہدف کی آواز سنائی دے سکتی ہے یا نہیں: ایک نوٹ 8 بار دہرایا جاتا ہے۔ آدھے ٹرائلز میں ٹارگٹ ساؤنڈ شامل ہے، اور آدھے نہیں۔\n\nآپ کا کام: سننے کے بعد، اگر آپ نے ہدف کی آواز سنی ہے تو "y" دبائیں، یا اگر آپ نے نہیں سنی تو "n" کو دبائیں۔ حجم آپ کے جاتے ہی ایڈجسٹ ہو جائے گا، جس سے ہدف بمشکل قابل شناخت ہو جائے گا۔\n\nپریکٹس بلاک میں ہدف اکیلا ہوگا۔ بعد میں، دوسری آوازیں بھی چلیں گی — انہیں نظر انداز کریں اور صرف ہدف کا پتہ لگانے پر توجہ دیں۔\n\nواپسی کو دبائیں یا آگے بڑھنے پر کلک کریں۔ ',
